  "title": "Audeze - LCD-3",
  "id": "445097993",
  "description": "Designed & Made in USA\n\nBalanced Sound Signature\n\nIdeal for Audiophiles\n\nFor Studio & Professionals\n\nIdeal for Indoor Use\n\n3 Years Warranty On Drivers\n\nOpen-Back Design\n\nPlanar Magnetic Drivers\n\nNeeds Amplification\n\nReplaceable Mini XLR Cables\n\nDESCRIPTION\n\nTHE MOST TRUSTED HEADPHONE BY AUDEZE\n\nThe Audeze LCD-3 is a thoroughly engineered and meticulously hand-built headphone. Its best-in-class accuracy makes it an irreplaceable tool for those requiring the most transparent audio reproduction available. Step into a new world of music, full of rich detail, low-end clarity and overall accuracy.\n\nENJOY EXTENDED FREQUENCIES & LOWER DISTORTION\n\nThe LCD-3 uses Fazors, special acoustical elements positioned on either side of the magnetic structure. They enhance transparency by affecting the sound waves generated by large planar diaphragms. A few of the benefits include extended frequency response, improved high-frequency extension and lowered distortion, with better imaging.\n\nEXPERIENCE AUDEZE'S PROPRIETARY PLANAR MAGNETIC DRIVERS\n\nRather than use standard headphone drivers that operate like miniature woofers or tweeters, the LCD-3 uses a large, 6.17-square-inch thin-film planar magnetic driver that's embedded with Audeze's proprietary Lotus diaphragm that's thinner than a human hair for fast response times. This gives a smooth, resonance-free frequency response, excellent internal damping, edge damping, very low distortion and extremely fast transient response.\n\nMIX & MASTER ANYWHERE & EVERYWHERE\n\nNot everyone can listen to their headphones in an acoustically treated room. With the Audeze Reveal plugin, you can add custom filter presets to all Audeze flagships. Now, mix and master in virtually any location, be it the studio, your home or even on top of an active volcano.\n\nHANDCRAFTED WITH PREMIUM MATERIALS\n\nMade in the USA, the Audeze LCD-3 are handcrafted using high-quality luxurious materials. It features Audeze's tonal balance and powerful bass that beautifully articulates the power and nuance of your favourite music. The gorgeous wooden rings are designed for the audiophile with a discerning ear & style. The real lambskin leather or Microsuede earpads and headband use acoustical foam for the best fit and sound.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nMAX INPUT POWER\n15W (for 200ms)\n\nIMPEDANCE\n110 Ohms\n\nSENSITIVITY\n102dB\n\nFREQUENCY RESPONSE\n5Hz – 20kHz extended out to 50kHz\n\nMAGNET TYPE\nNeodymium\n\nCONTROLS & CONNECTIVITY\n\nWIRED CONNECTIVITY\n3.5mm to 1/4in stereo adaptor\n\nMICROPHONE\nNo\n\nDESIGN & BUILD\n\nWEARING STYLE\nOver-Ear\n\nCABLE TYPE\n2.5m 1/4in to dual 4-pin mini-XLR cable, 2.5m 4-pin XLR to dual 4-pin, Mini-XLR cable\n\nWEIGHT\n543g\n\nIN THE BOX\n\nBOX CONTENTS\n1. Audeze - LCD-3 Headphones\n\n2. 2.5m 1/4in to dual 4-pin mini-XLR cable\n\n3. 3.5mm to 1/4in stereo adapter\n\n4. Ruggedized travel case\n\nFAQs\n\nWhat is the warranty period on Audeze - LCD 3 and how do I claim it?\n\nThe warranty period of the Audeze LCD 3 is of 3 years. In order to claim warranty, please visit our Audeze warranty page. We are very helpful guys, just saying.\n\nWhere are these headphones made?\n\nAudeze headphones are engineered and handcrafted in the USA to our exacting quality standards.\n\nHow is the sound signature of Audeze LCD 3?\n\nIt is very hard to describe in words but I can say these headphones still retain the iconic warmth and vibrant presentation that have captivated listeners for more than a decade.\n\nDoes the LCD 3 require amplification?\n\nYes, it does require amplification. You can check out our collection of amplifiers and DACs here and desktop Amps here\n\nDo the LCD 3 come with a travel case?\n\nYes, it does come with a Ruggedized travel case.\n\nHow would you describe the sound of LCD 3?\n\nLuxuriously spacious with warm tonal balance and powerful bass.\n\nCan these headphones be used for Studio purposes?\n\nYes, they can be used for Mixing & Mastering.\n\nCan the LCD 3 be used in a 3.5mm headphone output?\n\nYes, you will simply need the 6.5mm to 3.5mm adapter.\n\nWarranty & Media Reviews\n\n3 Year Warranty\nDon't sweat it, this Audeze LCD-3 comes with a 3 year warranty on the driver and a 1 year warranty on the rest of the parts. Audeze's warranty covers all manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Audeze's warranty in India.\n\n\"Speakers that offer a similar level of insight, detail and sonic pleasure would cost multiple times this amount, so audiophiles are doing themselves a favour by using these cans.\"\nRead More\n\n\"When the LCD3s first arrived, I ended up lying down right there on the floor listening to music for over an hour. I can’t remember the last headphone that elicited that kind of reaction.\"\nRead More\n\n\"Beautiful design, exceptional bass and mids combined with that desire for status in owning one of these beauties is too tantalizing to hope to ignore.\"\nRead More\n\n\"Audeze has done a lot more on these than merely making the sound more spacious and improving treble extension. I would pay the $2K if I have the money because the three is just that much better.\"\nRead More\n\n\"There’s no denying the LCD-3s are expensive, but such is the quality of their performance that they almost seem like good value. A solid, authoritative presentation, Excellent detail.\"\nRead More\n\n\"I briefly had it at home, and its brute-force dynamic impact, out-of-head imaging, and transparency all improved the sound of the LCD-3s.\"\nRead More\n\n“Words fail to describe the level of accuracy the LCD-3 are capable of, or the absolutely jaw-dropping level of detail with which they extract every nuance contained within music.”\nRead More",
