  "title": "JVC - HA-ET90BT",
  "id": "1998848360511",
  "description": "Designed in Japan\n\nBalanced Sound Signature\n\nNeodymium Drivers\n\nIdeal for Casual Music Listening\n\nIdeal for Sports & Gym\n\nWorks with Android & iOS\n\n1 Year of Warranty\n\nIPX5 Sweat Resistance\n\nUse Wirelessly with Bluetooth\n\n3+6 Hours of Battery Life\n\nWireless Range of 10m\n\nDESCRIPTION\n\nDesigned For Sportsmen\n\nJVC has worked specifically to develop the HA-ET90BT for serious runners and athletes. The idea behind this was to ensure music can be used as a motivation for runners to push themselves further and enjoy a stress-free experience while training.\n\nSafe And Secure Fit\n\nThe ET90BT comes in an oval design and a pivot motion fit which ensures that the earbuds fit securely in your ears and prevent them from falling off easily. This in turn lets you use these for rigorous exercises and workouts without having to deal with loose earbuds.\n\nSweat Your Way\n\nFitted with IPX5 water and sweat resistance you can use these during the sweatest of workouts as well as during a jog in the rains. One less thing to worry about while working out.\n\nEnjoy Long Listening Sessions\n\nThe ET90BT comes with 3 hours of earbud battery life which should suffice your everyday workout. In case you want to listen for a longer period of time, the charging case provides an additional 6 hours of battery life. Also, since the case is portable you can take them everywhere you go.\n\nApps Your Way\n\nJVC comes with an app which guides you with everything you need to control your earbuds. From battery indicator to freedom of sound customization all things are possible when using the app. Also, the \"Find\" feature lets you spot your earbuds in the night as it emits a sound and the LED lights begin to flicker. Available for Android & iOS.\n\nGet A Customized Playlist\n\nThe \"Run & Music\" app analyses the music you are listening and curates a playlist from that stored in your smartphones. The songs are chosen in such a way that the beats increase in order to help you increase your running speed naturally along with the song.\n\nSee More\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVER UNIT\n8.2mm\n\nFREQUENCY RESPONSE\n20-20,000Hz\n\nMAGNET TYPE\nNeodymium\n\nTRANSMISSION AREA\nApprox.33.3ft (10m)\n\nCONTROLS & CONNECTIVITY\n\nWIRELESS CONNECTIVITY\nBluetooth\n\nMICROPHONE\nYes\n\nEARPHONE BATTERY LIFE\n3 hours\n\nCHARGING CASE BATTERY LIFE\n6 hours\n\nCHARGING TIME\nApprox. 3 hours\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nPOWER SUPPLY\nBuilt-in rechargeable battery\n\nIN THE BOX\n\nBOX CONTENTS\n1. JVC - HA-ET90BT Earpbuds\n\n2. Charging case\n\n3. S/M/L silicone Open\n\n4. S/M/L Regular Open\n\n5. USB charging cable\n\n6. Carrying pouch\n\nCOMPARISONS\n\nJVC - HA-ET90BT\n\n₹ 4,999/- ₹ 9,999/- SEE MORE\n\nLYPERTEK - TEVI (PurePlay Z3)\n\n₹ 6,999/- ₹ 8,999/- SEE MORE\n\nJays - F-Five True Wireless\n\n₹ 4,999/- ₹ 7,999/- SEE MORE\n\nJAYS - t-Seven True Wireless\n\n₹ 9,999/- ₹ 14,999/- SEE MORE\n\nWarranty\n\nSound Signature\n\nBalanced\n\nBalanced\n\nWarm&Smooth\n\nWarm&Smooth\n\nBluetooth Version\nv4.2\nv5.0\nv5.0\nv5.0\n\nBluetooth Codecs\nSBC\naptX, AAC SBC\nSBC\nSBC\n\nInterface\nButton\nButton\nTouch\nTouch\n\nEarbuds Battery\n3 Hours\n10 Hours\n4 Hours\n5 Hours\n\nCharging Case Battery\n6 Hours\n60 Hours\n16 Hours\n15 Hours\n\nWater Resistance\nIPX5\nIPX7\n\nRange\n10m\n10m\n10m\n10m\n\nVoice Assistant\nSiri/Google Assistant\nSiri/Google Assistant\nSiri/Google Assistant\nSiri/Google Assistant\n\nMono Pairing\n\nAmbient Sound Transparency\n\nApp Control\n\nANC\n\nEartips\n3x Pairs Silicone Ear Tips\n3x Pairs Silicone Ear Tips\n3x Pairs Silicone Eargels\n3x Pairs Silicone Eargels\n\nExperts Verdict\n\"The “Bass” profile makes the sound more fun. The JVC HA-ET90BT are pretty solid when it comes to signal reliability. I haven’t experienced a loss in connection even once.\" Trusted Reviews\n\n\"If you’re looking for a pair of true wireless earphones for sport or everyday commuting work and you don’t want to remortgage your home to get them, I can heartily recommend the Lypertek TEVI.\" Forbes\n\nSEE MORE\nSEE MORE\nSEE MORE\nSEE MORE\n\nFAQs\n\nWhat is the warranty period on JVC HA-ET90BT?\n\nJVC comes with a 1 year warranty. Read more on\n\nIs it compatible with all devices?\n\nIt works with all Android and iOs devices.\n\nDoes it have noise cancellation?\n\nNo, but it has decent noise isolation due to its design and fit. You will still be able to listen to loud commuters screaming at their phone, but slightly reduced.\n\nDoes it come with a mic?\n\nNo these do not come with a mic.\n\nBUYING GUIDE\n\nBest Wireless Earbuds at every Price Point in 2020\nby Abhijeeth Shetty February 11, 2020\nGo through the handpicked list of best wireless earbuds and pick the perfect pair of earbuds that suits your style and budget.\nRead More\n\n6 Reasons Why You Should Go Truly Wireless\nby Bernadette Braganza February 18, 2020\nNeed us to convince you to ditch that wired (or not so wired) earphone? Well, we’ll give you not one or two but six good reasons why you should go wireless. So, what are you waiting for? Let’s go!\nRead More\n\nBluetooth Codecs Explained\nby Nikita Ghate June 25, 2018\nWhile wired headphones have always been widely preferred, wireless headphones are breaking their way in. Authentic quality lossless music can now be streamed wirelessly thanks to the development of advanced audio codec algorithms. Confused? Let’s take it one complex term at a time.\nRead More\n\nThe Best Sports Earphones For Every Budget\nby Abhijeeth Shetty March 17, 2020\nFinding your new long-run companion? We have got you covered under your budget. Read the buying guide to choose the one for you.\nRead More\n\nSound Signatures Explained\nby Shanth Swaroop February 04, 2020\nAn audiophile guide to Sound frequencies, Sound signatures and how they are categorized in the audiophile community. An article explaining the major Sound signatures and which headphones are tuned to such signatures.\nRead More\n\nBest Headphones under 10000 in 2020\nby Abhijeeth Shetty February 27, 2020\n\nScan through the list with our go-to guide of headphones under Rs. 10000 to find the best one for you.\nRead More\n\nBest Wireless Earphones Under Rs. 10,000\nby Abhijeeth Shetty March 20, 2020\n\nThe number of wireless in-ears is increasing in the market. This makes it confusing to pick the best one. To help you choose the perfect wireless earphone as per your needs, here is a list we have prepared with the help of our in-house experts.\nRead More\n\nMEDIA REVIEWS\n\n\"Water-resistant, sports-focused design, Secure in-ear fit, Neoprene pouch with clip means you can bring all accessories along while you work out.\"\nRead More\n\n\"The “Bass” profile makes the sound more fun. The JVC HA-ET90BT are pretty solid when it comes to signal reliability. I haven’t experienced a loss in connection even once.\"\nRead More\n\nWARRANTY\n\nDon’t sweat it, This JVC product is covered by a 1 year manufacturer's warranty. Learn more",
