  "title": "Sony - WI-C200",
  "id": "1876125712447",
  "description": "Designed in Japan\n\nWarm & Smooth Sound Signature\n\n1 Year of Warranty\n\nIdeal for Casual Music Listening\n\nIdeal for Commuting\n\nIdeal for the workplace\n\nIdeal for Taking Calls\n\nBluetooth with AAC\n\n15 Hours of Battery Life\n\nWireless Range of 10m\n\nVolume Controls\n\nSuper Lightweight Design\n\nOne of our top-sellers, the WI-C200 makes for a great to-go earphones. Light-weight, magnetic buds and a 15 hours of battery so they go wherever you do.\n\nPRAVEEN KAMATH\nHeadphone Guru\n\nAbout PRAVEEN KAMATH\nPraveen, our Headphone Zone is an audio connoisseur and staunch Meze fanboy. He loves the RAI Penta and the Empyrean, equally. When not writing about, thinking about or listening to music: He's an avid beerologist too and staunchly believes that the combination of both beats every music setup out there! You'll often find him listening to The Weeknd, The Score and The Script.\n\nDESCRIPTION\n\n15 HOURS OF WIRELESS PLAYBACK\n\nThe Sony WI-C200 has a battery life of 15 hours of continuous usage. Listen to your favorite playlist throughout the day. Its battery is enough to last the day and even beyond! Now go wireless and away from tangles with the Sony WI-C200. Use Bluetooth technology to connect to your device and enjoy your music for hours without any interruption.\n\nCRISP, WARM SOUND SUITED FOR ALL GENRES\n\nThe Sony WI-C200's 0.35-inch dynamic drivers deliver an amazing sound performance with intense bass and crystal clear audio. Now enjoy your music with astonishing audio quality.\n\nQUICK CHARGE FOR FEW MINUTES FOR HOURS OF PLAYBACK\n\nDon’t worry when your battery goes down, just charge your Sony WI-C200 for 10mins and get an amazing playtime of 1 hour. You can also charge your Sony earphones' battery to 100% in just 3 hours. Now, whenever you are in a hurry just charge it for a few minutes and you are ready to go and rock the world.\n\nCOMFORTABLE. LIGHTWEIGHT. HANDY.\n\nThese Sony earphones come with an in-built magnet on the earbuds that join together when you are not listening to music. The design is comfortable and lightweight, making them easy to carry around. The Sony WI-C200 has been built to be lightweight, soft, flexible as well as durable. The behind-the-neck design also makes it really comfortable. Carry these in-ear headphones anywhere and everywhere.\n\nHANDS-FREE COMMUNICATION, NOW WITH SEAMLESS VOICE ASSISTANT ACCESS\n\nTThe in-line remote helps you to manage your music. Play, stop, adjust the volume and skip through tracks whenever you want. Just by pressing a button you can connect your smartphone’s voice assistant to get directions. Manage your calls by using the built-in microphone. You don’t even have to remove your phone from the pocket. Now enjoy hands free calling using your wireless earphones.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVER UNIT\n9mm\n\nFREQUENCY RESPONSE\n20 Hz–20,000 Hz\n\nMAGNET\nNeodymium\n\nCONTROLS & CONNECTIVITY\n\nWIRELESS CONNECTIVITY\nBluetooth v5.0\n\nMICROPHONE\nYes\n\nBATTERY CHARGE TIME\nApprox. 3.0 hrs\n\nBATTERY LIFE (CONTINUOUS MUSIC PLAYBACK TIME)\nMax. 15 hrs\n\nBATTERY LIFE(CONTINUOUS COMMUNICATION TIME)\nMax. 15 hrs\n\nBATTERY LIFE (WAITING TIME)\nMax. 200 hrs\n\nBATTERY CHARGE METHOD\nUSB charging\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nNECKBAND\nNo\n\nWEIGHT\nApprox. 19 g\n\nIN THE BOX\n\nBOX CONTENTS\n1.Sony - WI C200 Wireless Earphones\n\n2.Earbuds: Hybrid earbuds (S/M/L)\n\n3.USB cable: Type-C (approx. 20 cm)\n\nCOMPARISONS\n\nSony - WI-C200\n\n₹ 1,699/- ₹ 2,990/- SEE MORE\n\nJAYS - t-Four Wireless\n\n₹ 1,999/- ₹ 4,999/- SEE MORE\n\nMEE Audio - X6 (2nd Gen)\n\n₹ 1,999/- SEE MORE\n\nSony - WI-XB400\n\n₹ 2,990/- ₹ 4,990/- SEE MORE\n\nWarranty\n\nSound Signature\n\nWarm & Smooth\n\nV-Shaped\n\nWarm & Smooth\n\nExtra-Bass\n\nBluetooth Version\nv5.0\nv4.1\nv5.0\nv5.0\n\nBluetooth Codecs\nSBC, AAC\n\nSBC, AAC\n\nMultipoint Connectivity\n\nBattery Life\n15 Hours\n10 Hours\n8.5 Hours\n15 Hours\n\nRange\n10m\n10m\n10m\n10m\n\nVoice Assistant\nSiri/Google Assistant\n\nSiri/Google Assistant\nSiri/Google Assistant\n\nWater Resistance\n\nIPX5\n\nEartips\n3x Pairs Hybrid Earbuds\n3x Pairs Silicone Ear Tips 3x Pairs Foam Ear Tips\n4x Pairs Silicone Ear Tips Earfins\n\nExperts Verdict\n\"If you’re looking for portable wireless in-ear headphones at a great budget price, then get the Sony WI-C200.\" Forbes\n\n\"Lightweight and ergonomic wireless in-ear headset designed for active lifestyles . Over-the-ear fit with flex-wire earhooks is secure for any activity.\" What Hi-Fi?\n\n\"A well-balanced signature that will suit both, bass-heads and normal people. Punchy enough for pop, subby enough for hip-hop and warm enough for a fleshy rock track.\" Major Hi-Fi\n\nSEE MORE\nSEE MORE\nSEE MORE\nSEE MORE\n\nFAQs\n\nWhat is the battery life on Sony WI-C200?\n\nThe Sony WI-C200 offers 15 hours of battery life. If you are looking for a battery our top recommendation for you will be the SoundMAGIC E11BT, it offers a great 24 hours of battery life for all-day use.\n\nI listen to a lot of EDM, Rock, and Metal songs. Is the Sony WI-C200 suitable for that?\n\nThe Sony WI-C200 comes with a warm sound. For better bass we would highly recommend you go with the Sony WI-XB400, it features deep bass with great clarity over the vocals. An ideal pick for bass lovers.\n\nDoes Sony WI-C200 come with a remote?\n\nYes, it comes with a 3-button remote to control your music on-the go.\n\nWhich Bluetooth version Sony WI-C200 comes with?\n\nIt comes with Bluetooth version 5.0\n\nDoes Sony WI-C200give access to Siri or Goggle Assistant\n\nYes, it comes with Voice Assistant to active Siri or Google Assisttant by tapping the middle button twice.\n\nWhat is the warranty period on Sony WI-C200 and how do I claim warranty?\n\nThe warranty period on all Sony products is 1 year from the date of purchase. In order to claim warranty, please visit our Sony warranty page. We are very helpful guys, just saying.\n\nCan I take calls with the Sony WI-C200?\n\nThe Sony WI-C200 supports normal incoming calls only. Other calling applications on smartphone or computers are not supported.\n\nDoes Sony WI-C200 have noise cancellation?\n\nNo, but it does have a noise isolation which will eliminate the noise in your surroundings to some extent.\n\nDo the Sony WI-C200 come with a volume rocker?\n\nYes, Sony WI-C200 comes with a universal mic and three-button remote that lets you do things on the go.\n\nWhat is the overall sound of Sony WI-C200?\n\nThe Sony WI-C200 delivers little warmth in bass with natural vocals and treble. A perfect fit for all kinds of genres.\n\nBUYING GUIDE\n\nThe Best Earphones Under 2000 in 2020\nby Shanth Swaroop February 19, 2020\n\nLow on budget? Check out our curated list of in-ear earphones and make the most out of it.\nRead More\n\nBest Bluetooth Earphones Under Rs. 2000\nby Shanth Swaroop February 18, 2020\n\nFrom gorgeous stylish looks to delightful sound to various cool features; here are the best Bluetooth earphones under Rs. 2000 that you should definitely check out.\nRead More\n\nUltimate Buying Guide to the Best iPhone Headphones\nby Abhijeeth Shetty May 09, 2020\nWhile there are a lot of iPhone headphones out there, finding the perfect pair of headphones is a task and that’s where our power comes to the rescue.\nRead More\n\nWARRANTY AND MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this Sony WI-C200 comes with a 1 year warranty from Sony that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Sony's warranty in India.\n\n\"If you’re looking for portable wireless in-ear headphones at a great budget price, then get the Sony WI-C200.\"\nRead More\n\n\"WI C200 comes with Decent audio reproduction, Portable and flexible around-the-neck design, Good battery life.\"\nRead More",
