  "description": "Chi-Fi Excellence\n\nV-Shaped Sound Signature\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nIdeal for Casual Music Listening\n\nIdeal for Commuting\n\nIdeal for Taking Calls\n\n1 Dynamic + 4 BA Drivers\n\nWorks with Android & iOS\n\nTangle-Free Cables\n\nReplaceable 2-Pin Cables\n\nSuper Lightweight Design\n\nA penta-driver configuration at a price quite unheard of is insane innit? The ZS10 Pro more than delivers with it.\n\nPRAVEEN KAMATH\nHeadphone Guru\n\nAbout PRAVEEN KAMATH\nPraveen, our Headphone Zone is an audio connoisseur and staunch Meze fanboy. He loves the RAI Penta and the Empyrean, equally. When not writing about, thinking about or listening to music: He's an avid beerologist too and staunchly believes that the combination of both beats every music setup out there! You'll often find him listening to The Weeknd, The Score and The Script.\n\nDESCRIPTION\n\n4 BALANCED ARMATURES + 1 DYNAMIC DRIVER FOR INCREDIBLE SOUND\n\nAs an upgraded version of the ZS10, the KZ ZS10 Pro uses customised balanced armature drivers, 2 for the high and 2 for the mid frequencies. It also adopts the 2nd generation Tesla double magnetic dynamic unit for the rhythm and bass.\n\nUSES ADVANCED TECHNOLOGY TO MAKE YOUR MUSIC COME ALIVE\n\nKZ's independent research and development with dynamic drivers are responsible for the ZS10 Pro's low-frequency output. It is excellently crafted using the PCB electronic frequency division board resulting in smooth and distortion-free sound. The Dual Balanced Armature drivers are responsible for the mid and treble performance. It provides a high-intensity resolution, rich sense of quality and full vocals that makes these IEMs a pure listening experience for you.\n\nDESIGNED TO LOOK GOOD & LAST LONG\n\nThis IEM's faceplate is made of 304 stainless steel while the cavity is made from imported resin. These two different materials add shimmer and an exquisite look to the earphone which also makes them durable and long-lasting. The superior noise isolation cancels out ambient sound.\n\nMADE TO BE FLEXIBLE\n\nThe ZS10 Pro's wire hooks are made of expensive memory metal, which makes it very convenient for users to adjust the earphones around the ear. The cable that comes in the box terminates in a 3.5mm plug and comes with an inline remote & mic. It's easy to change your IEMs from wired to wireless or upgrade the cable with the detachable 2-pin slots. The new limit slot protection design keeps the pins from breaking and ensures a longer life.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVER TYPE\n5 Drivers (4 x BA + 1 x Dynamic)\n\nIMPEDANCE\n24 Ohms\n\nSENSITIVITY\n111dB\n\nFREQUENCY RESPONSE\n7-40,000Hz\n\nCONTROLS & CONNECTIVITY\n\nWIRED CONNECTIVITY\n3.5mm Input\n\nMICROPHONE\nYes\n\nREMOTE\n1-Button\n\nCOMPATIBILITY\nUniversal\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nCABLE LENGHT\n1.2m\n\nIN THE BOX\n\nBOX CONTENTS\n1. KZ ZS10 Pro Earphones\n\n2. 3 x Silicon cover\n\n3. User manual\n\nCOMPARISONS\n\nKZ - ZS10 Pro\n₹ 4,099/- ₹ 4,999 SEE MORE\n\nKZ - ZAX\n₹ 5,999/- ₹ 7,999 SEE MORE\n\nKZ - ASF\n₹ 6,499/- ₹ 7,999 SEE MORE\n\nKZ - AS12\n₹ 6,999/- ₹ 7,499 SEE MORE\n\nSound Signature\n\nMicrophone\n\nDriver Type\nHybrid Driver\nHybrid Drivers\nBalanced Armature Drivers\nBalanced Armature Drivers\n\nDriver Configuration\n4x BA + 1x Dynamic Driver\n7x BA + 1x Dynamic Driver\n5x Balanced Armature Drivers\n6x Balanced Armature Drivers\n\nSensitivity\n111dB\n113dB\n105dB\n103dB\n\nImpedance\n24Ω\n24Ω\n18Ω\n16Ω\n\nCompatibility\nUniversal\nUniversal\nUniversal\nUniversal\n\nDetachable Cable\n2-Pin\n2-Pin\n2-Pin\n2-Pin\n\nConnector Type\n3.5mm\n3.5mm\n3.5mm\n3.5mm\n\nIn The Box\nKZ ZS10 Pro Earphones 3 X Silicon Cover User Manua\nKZ ZAX Earphones Silver-Colored Cable With Clear Rubber Connectors And White Mic Control 3 Pairs Of Silicone Ear Tips\nKZ ASF Earphones 3 Pairs Of Silicon Eartips\nKZ AS12 Earphones 3 Pairs Of Silicone Ear Tips\n\nExperts Verdict\n\"The KZ ZS10 Pro is a nice improvement over the original ZS10. The sound is more resolving, the midbass body is better, the treble has more articulation and emphasis, and it sounds more transparent.\" Headfonia\n\n\"The cable is likewise lightweight and curves nicely over the ear to hold the IEMs. This ergonomic design should be comfortable for virtually anyone.\" Headphonesty\n\n\"KZ ASF is one of the new/refreshed models from KZ. Despite the bulbous shape and larger-than-average housing the KZ ASF is fairly comfortable to wear.\" audioreviews.org\n\nSEE MORE\nSEE MORE\nSEE MORE\nSEE MORE\n\nFAQS\n\nWhat is the warranty period on the KZ ZS10 Pro and how do I claim warranty?\n\nThe warranty period on KZ ZS10 Pro is for 1 year. Read more information on Click here.\n\nWhat is the sound signature in the KZ ZS10 Pro?\n\nThe KZ ZS10 Pro comes with a V-Shaped Sound Signature that delivers a deep bass with great clarity over the mids. So that you can enjoy listening to genres like EDM, Rock, Hip-Hop, Pop or Bollywood.\n\nCan I take calls on the KZ ZS10 Pro?\n\nYes, the KZ ZS10 Pro comes with an inline microphone so that you can take calls on the go.\n\nWill the KZ ZS10 Pro Pro work with my smartphone?\n\nYes! The KZ ZS10 Pro is compatible to work with both Android and iOS.\n\nHow is the overall fit of KZ ZS10 Pro?\n\nThe KZ ZS10 Pro comes with an over-ear design which gives a secure fit. Also the lightweight design of ZS10 Pro makes them comfortable to use for long hours.\n\nHow many drivers does the KZ ZS10 Pro come with?\n\nThe KZ ZS10 Pro is loaded with 4 Balanced Armature Drivers and 1 Dynamic Driver.\n\nAre the cables on the KZ ZS10 Pro replaceable?\n\nYes, the KZ ZS10 Pro comes with replaceable 2pin cables.\n\nWhat is the impedance on the KZ ZS10 Pro?\n\nThe KZ ZS10 Pro comes with an impedance of 24Ω.\n\nAre the cables on the KZ ZS10 Pro tangle free?\n\nYes, the KZ ZS10 Pro comes with tangle free cables. One less thing to worry about.\n\nWhich Comply eartips will be compatible with my KZ ZS10 Pro?\n\nYou can get the Comply Audio Pro or the Comply Sport Pro for your KZ ZS10 Pro.\n\nBUYING GUIDE\n\nBest Wireless Earphones under Rs. 5000\nby Abhijeeth Shetty March 06, 2020\n\nDon't know how to spend your hard-earned money in the best way? Choose from the best wireless earphones below Rs. 5000.\nRead More\n\nBest Headphones Under Rs. 5000\nby Abhijeeth Shetty March 05, 2020\n\nFor the confused Indian buyer: here is list of top recommendations and our best headphones under 5000.\nRead More\n\nA Simple Guide to Sound Signatures\nby Shanth Swaroop February 04, 2020\n\nAn audiophile guide to Sound frequencies, Sound signatures and how they are categorized in the audiophile community. An article explaining the major Sound signatures and which headphones are tuned to such signatures.\nRead More\n\nHeadphone Zone Festive Gift Guide for 2020\nby Abhijeeth Shetty October 14, 2020\nThis festive season, lighten up your life with awesome sound and celebrate with good music. Have a good one and stay safe.\nRead More\n\nWARRANTY & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this KZ ZS10 Pro comes with a 1 year warranty from KZ that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about KZ's warranty in India.\n\n\"The KZ ZS10 Pro is a nice improvement over the original ZS10. The sound is more resolving, the midbass body is better, the treble has more articulation and emphasis, and it sounds more transparent.\"\nRead More",
