  "id": "1906918195263",
  "description": "Chi-Fi Excellence\n\nBalanced Sound Signature\n\n1 Year of Warranty\n\nIdeal for Commuting\n\nIdeal for Audiophiles\n\nBest Suited for Portable Use\n\n10mm Dynamic Drivers\n\nReplaceable MMCX Cables\n\nMetal Build\n\nWorks with Android & iOS\n\nTangle-Free Cables\n\nSuper Lightweight Design\n\nDESCRIPTION\n\nSOUND AND SLEEK STYLE MEET HI-RES AUDIO\n\nThe ME100 is the latest earphone from the house of Shanling. Inspired by the shape of water droplets, this gorgeous earphone features a smooth and sleek design. Thanks to its dynamic driver frequency response extending up to 40,000Hz, the Shanling ME100 has been certified as Hi-Res by the Japanese Audio Association.\n\nENERGY EFFICIENT DRIVERS AND WELL TUNED ACOUSTIC CHAMBERS FOR A BALANCED SOUND\n\nFitted with a 10mm dynamic driver with nanocomposite diaphragm, the ME100 works perfectly with any phone or portable audio player. The drivers offer better energy efficiency, thanks to its magnetic flux density exceeding one tesla. It uses lightweight CCAW voice coils that lead to better transient response, enhanced mids and sibilance-free treble. The drivers have been developed using a 10mm PE+PEEK composite diaphragm along with over 30 years of Hi-Fi experience, thus offering a balanced and clean sound.\n\nMMCX DETACHABLE CONNECTORS WITH HIGH PERFORMANCE CABLES FOR SUPERIOR SOUNDSTAGING\n\nThe cable is made from high purity oxygen-free copper (OFC). Each core consists of 18 conductors per wire offering a higher resolution and soundstage performance. The TPE covering reduces the microphonics of the cable to avoid any disturbances. You can easily replace the existing cable with any other premium cable, all thanks to the gold-plated MMCX connectors.\n\nDEW-DROP DESIGN, BEHIND-THE-EAR FIT FOR LONGER LISTENING DURATIONS\n\nThe ME100 has been designed for long listening sessions. The behind-the-ear cable design makes sure that they stay secure no matter the activity. The housings are made of a tough 6000 Series Aluminium Alloy that reduces internal harmonic resonance while lasting a long time.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVERS\n10m Drivers\n\nDRIVER TYPE\nDynamic\n\nFREQUENCY RESPONSE\n20 - 40,0000 Hz\n\nSENSITIVITY\n111 ± 3 dB\n\nIMPEDANCE\n16 Ω\n\nCONTROLS & CONNECTIVITY\n\nPLUG\n3.5 mm gold plated\n\nMICROPHONE\nNo\n\nCOMPATIBILITY\nUniversal\n\nCONNECTOR\nMMCX\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nWIRE\nOxygen-Free Copper\n\nCABLE\n1.3 m\n\nWEIGHT\n28 g\n\nIN THE BOX\n\nBOX CONTENTS\n1. Shanling ME100 Earphones\n\n2. Leather storage case\n\n3. 8 x Eartips\n\n4. Cleaning tool\n\n5. Buying guide\n\nFAQs\n\nDoes Shanling - ME100 have noise cancellation?\n\nNo, the Shanling ME100 can provide immersive noice isolation. When paired with the right pair of comply foam tips it can put noice cancelation to shame.\n\nDoes Shanling - ME100 have a remote and microphone?\n\nNo, Shanling - ME100 does not has an inline remote and a microphone.\n\nDoes Shanling - ME100 come with a carry case?\n\nYes, they do come with a leather case. Did you just smile?\n\nWhat is the warranty and how do I claim it?\n\nShanling offers a one year warranty. If you need to claim warranty, you can contact us. We are quite friendly people, just sayin. You can read more about warranty here.\n\nWhat materials are used to build these earphones?\n\nThe Shanling ME100 is built with highly durable aluminum shell reducing unwanted resonances.\n\nWhat type of drivers does Shanling - ME100 use?\n\nThey come with dual 10 mm balanced & dynamic driver that delivers better energy efficiency and improved transient response.\n\nDo these earphones come with removable cables?\n\nYes, the ME100 come with replaceable cables. That means you can now swap them with any cable that come with MMCX connectors.\n\nWhat type of eartips do these earphones come with?\n\nThey come with three different types of eartips that is Vocal, Bass and Balanced for you to adjust to different sound preferences.\n\nWarranty & Media Reviews\n\n1 Year Warranty\nDon't sweat it, this Shanling ME100 comes with a 1 year warranty from Shanling that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Shanling's warranty in India.\n\n\"These shine among Chi-Fi earphones I’ve tested here. They look, and feel, unique, and come with quality accessories. As always, Shanling’s branding is on pitch.\"\nRead More\n\n\"With the ME100, Shanling have come up with high quality IEMs that set themselves apart within a very competitive segment with a tuning aimed towards clarity and detail.\"\nRead More\n\n\"The ME100 can handle every genre with grace. In fact, I hardly ever do this, but I think these babies deserve the coveted MajorHiFi Gold Award.\"\nRead More",
