  "description": "Designed in Japan\n\nExtra Bass Sound Signature\n\nIdeal for Casual Music Listening\n\nIdeal for Taking Calls\n\nIdeal for Commuting\n\n1 Year of Warranty\n\nVolume Controls\n\nWorks with Android & iOS\n\nUse Wirelessly with Bluetooth\n\n5 Hours of Battery Life\n\nWireless Range of 10m\n\nThis one is absolutely perfect for bassheads. They stay true to the name - Xtreme Xplosives. But they also are well built, and are super convenient to carry to the gym or travel everyday. JVC has been known for making value for money earphones.\n\nRAGHAV SOMANI\nHeadphone Guru\n\nAbout Raghav Somani\nRaghav Somani is the Founder & CEO of Headphone Zone. An avid audiophile and musician since 2008, his choice of headphones include STAX Electrostats, Audeze LCD 3, and for music on the go, the JH Audio Roxanne + Astell&Kern SP1000 is never too far away. On his playlist, you'll find A.R. Rahman, Michael Jackson, and the Eagles.\n\nDESCRIPTION\n\nXX-SERIES, XX-BASS\n\nXX-series FX103BT in-ear headphones reproduce powerful bass sound by Extreme Deep Bass Ports and fine-tuned neodymium driver units.\n\n8.5MM NEODYMIUM DRIVERS FOR POWERFUL SOUND\n\nThe JVC HA-FX103BT doesn’t fail to provide you with high-end stereo quality sound. Its 8.5mm Neodymium driver units have a wide frequency range of 20 to 20,000 Hz while the Extreme Deep Bass Ports offer a rich bass-heavy sound output.\n\nHASSLE-FREE HANDS-FREE EXPERIENCE\n\nPlay, pause and take calls with ease with the 3-button inline remote and mic. Now hands free functionality is possible at the touch of a button.\n\n5 HOURS OF BATTERY FOR UNLIMITED BASS\n\nThese in-ear headphones are Bluetooth-enabled and consist of 5 hours of playback time. Now, enjoy your music for most of the day.\n\nDURABLE AND STURDY\n\nThese earphones are known for their long-lasting durability. The tough protectors make sure that they don't break easily.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVER UNIT\n8.5mm\n\nIMPEDENCE\n16 ohms\n\nFREQUENCY RESPONSE\n20-20,000Hz\n\nMAGNET TYPE\nNeodymium\n\nCONTROLS & CONNECTIVITY\n\nWIRELESS CONNECTIVITY\nBluetooth 4.1\n\nREMOTE & MIC\nYes\n\nBATTERY LIFE\n5 hours\n\nCHARGING TIME\n2.5 hours\n\nBLUETOOTH PROFILE\nAVRCP,A2DP,HSP,HFP\n\nSUPPORTING CODEC\nSBC\n\nPOWER SUPPLY\nRechargeable battery\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nWEIGHT (WITH CORD)\n0.53oz\n\nIN THE BOX\n\nBOX CONTENTS\n1. JVC HA-FX103BT Earphones\n\n2. Charging cable(Micro USB)\n\n3. S/M/L sizes ear pieces\n\n4. Carrying case\n\nCOMPARISONS\n\nJVC - HA-FX103BT\n\n₹ 1,899/- ₹ 3,999 SEE MORE\n\nJVC - HA-EC20BT\n\n₹ 1,399/- ₹ 2,999 SEE MORE\n\nSony - WI-C400\n\n₹ 2,999/- ₹ 3,990 SEE MORE\n\nJVC - HA-FX39BT\n\n₹ 2,299/- ₹ 3,999 SEE MORE\n\nWarranty\n\nSound Signature\n\nExtra-Bass\n\nV-Shaped\n\nWarm & Smooth\nWarm & Smooth\n\nBluetooth Version\nv4.1\nv4.1\nv4.2\nv3.0\n\nBluetooth Codecs\n\nSBC\n\nSBC\n\nSBC\n\nMultipoint Connectivity\n\nBattery Life\n\n5 Hours\n\n4 Hours\n\n20 Hours\n\n14 Hours\n\nRange\n10m\n10m\n10m\n10m\n\nVoice Assistant\n\nSiri/Google Assistant\n\nSiri/Google Assistant\n\nSiri/Google Assistant\n\nSiri/Google Assistant\n\nWater Resistance\n\nIPX2\n\nEartips\n\n3x Pairs Silicone Ear Tips\n\n3x Pairs Silicone Ear Tips, Open Type Earpieces\n\n4x Pairs Silicone Ear Tips\n\n2x Pairs Foam Ear Tips\n\nExperts Verdict\n\n\"The Sony WI-C400 are sub-par wireless in-ears with decent battery life, easy controls and a comfortable fit for sports use.\" Techradar\n\nSEE MORE SEE MORE SEE MORE SEE MORE\nFAQs\n\nCan I take calls with the JVC - HA-FX103BT?\n\nYes, you can easily take calls with the JVC - HA-FX103BT as it comes with an inbuilt microphone.\n\nWhat is the Bluetooth range on the JVC - HA-FX103BT?\n\nThe JVC - HA-FX103BT has a wireless range of 10m when connected to any Bluetooth devices.\n\nWhich connection do they use for charging?\n\nThe JVC - HA-FX103BT uses micro-USB for charging.\n\nWhat kind of charger should I use to charge the JVC - HA-FX103BT?\n\nThe best option is to use a 5V output charging source with the included cable. DO NOT use external chargers with output voltage above 5V (e.g. 9V, 12V etc.) as they might cause damages to the headphones.\n\nBUYING GUIDE\n\nThe Best Earphones Under 3000 in 2020\nby Shanth Swaroop February 19, 2020\nLow on budget? Check out our curated list of in-ear earphones and make the most out of it.\nRead More\n\nBest Bluetooth Earphones Under Rs. 3000\nby Shanth Swaroop February 18, 2020\nFrom gorgeous stylish looks to delightful sound to various cool features; here are the best Bluetooth earphones under Rs. 2000 that you should definitely check out.\nRead More\n\nBest Headphones for PUBG Mobile\nby Abhijeeth Shetty March 12, 2020\nWe present to you the list of 15 of the best earphones, bluetooth earphones, wireless earbuds and wireless headphones that don't just sound good but are great for mobile gaming.\nRead More\n\nBest Extra Bass Headphones of 2020\nby Abhijeeth Shetty May 09, 2020\nHere's our handpicked list of best bass headphones that will give you the right perspective of listening to the bass in your songs.\nRead More\n\nBest Wireless Headphones for TV\nby Bernadette Braganza May 09, 2020\nWith the plethora of options available, it’s become a more personalised thing; and to further this we’ve listed the best wireless headphones for TV.\nRead More\n\nUltimate Buying Guide to the Best Headphones for Redmi Note 4\nby Abhijeeth Shetty May 09, 2020\nWhile there are a lot of headphones for Redmi Note 4 out there, to find the perfect earphone for Redmi Note 4, is quite a task and that’s where our power comes to the rescue.\nRead More\n\nWARRANTY\n\n1 Year Warranty\nDon't sweat it, this JVC HA-FX103BT comes with a 1 year warranty from JVC that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about JVC's warranty in India.\n\n\"The FX103BTA is designed for those who love that little extra bass response. Featuring an 8.5mm Neodymium driver, you get an extremely punchy mid-bass and underlying sub-bass.\"\nRead More\n\n\"The JVC - HA-FX103BT does have a bass response that will leave the bass-lovers engaged. As far as sound isolation goes, these earphones offer plenty of passive noise cancellation.\"\nRead More",
