  "title": "Woo Audio - WA11 Topaz",
  "id": "1909177057343",
  "description": "Designed & Made in the USA\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nBest Suited for Portable Use\n\nUpto 6 Hours of Battery Life\n\nESS Sabre ES9018M DAC Chip\n\n4.4mm Balanced Output\n\n1.2W @ 30Ω Power Output\n\nMetal Build\n\nDESCRIPTION\n\nA RESULT OF EXTENSIVE RESEARCH FOR ADVANCED MUSIC LISTENING\n\nThe WA11 Topaz is the latest addition to the Woo Audio series of compact headphone amplifiers and DACs. An outcome of extensive research and real-world applications, the Woo Audio WA11 Topaz is designed to change the way you listen to music.\n\nEXPERIENCE HI-RES MUSIC VIA DESKTOP & OTHER PORTABLE DEVICES\n\nThe WA11 Topaz is engineered to deliver high-quality audiophile sound and features an in-built ESS Sabre DAC. This DAC can decode even hi-res music of up to 24-bit/384kHz PCM and up to DSD128 support via DoP playback. Use it conveniently with desktop systems and other portable devices.\n\nUP TO 6 HOURS OF CONTINUOUS PLAYTIME FOR ON-THE-GO MUSIC LISTENING\n\nThe WA11 Topaz is powered by a battery, making it perfect for out-of-home music listening. Enjoy up to 6 hours of continuous music listening on a single charge. When the battery level goes down, plug it into an electrical socket to listen to the music while charging the WA11 Topaz. You can charge it using dual USB Type-C ports.\n\nGET THE RIGHT BALANCED SOUND & DRIVE ALMOST ANY HEADPHONES CONVENIENTLY\n\nThe 4.4mm balanced input on the WA11 Topaz enables you to connect it with balanced sources like DAPs and DACs. It features a premium TKD 4-channel balanced potentiometer for clear audio and easy volume management. Drive even the most power-hungry headphones as well as sensitive IEMs, thanks to the Class-A topology offering the perfect blend of power and ultra-low noise.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nSUPPORTED INPUTS\n1x 4.4mm Pentaconn balanced 1x Asynchronous Hi-Speed USB Type-C port [data] 1x USB Type-C port [charge] (USB 2.0 compliant)\n\nSUPPORTED OUTPUTS\n1x 4.4mm Pentaconn balanced 1x 1/4\" TRS unbalanced for use with full-size headphones\n\nOUTPUT IMPEDANCE\n1Ω on both headphone outputs\n\nMAXIMUM POWER OUTPUT\n1.2W @ 30 Ohms 350mW @ 100 Ohms 120mW @ 300 Ohms\n\nFREQUENCY RESPONSE\n10 Hz to 200 kHz (-1 dB)\n\nSIGNAL/NOISE\n118dB\n\nDAC CHIP\nES9018M\n\nBATTERY LIFE\nUp to 6 hours, Rechargeable Lithium-ion battery\n\nWEIGHT\n426g / 0.93 lbs\n\nDIMENSIONS (W, H, D)\n155 x 85 x 27mm / 6.1 x 3.3 x 1 inches\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. WA11 Topaz amplifier/DAC\n\n2. Soft Alcantara carrying pouch x 1\n\n3. USB type-C to A cable (USB 2.0 compliant) x 1\n\n4. USB type-C to C cable (USB 2.0 compliant) x 1\n\n5. USB Charger with detachable AC plug x 1\n\n6. Wall plug adapter [UK, EU, Australia] x 3\n\n7. Quick start guide\n\nFAQs\n\nWhat is the warranty period on the Woo Audio WA11 Topaz?\n\nThe Woo Audio WA11 Topaz comes with a 1-year warranty. You can simply get in touch with us to claim the warranty. Click here.\n\nWhich devices can these be used alongside?\n\nThe WA11 can be used with desktops as well as a modern digital-audio-player (DAP), home CD player or DAC. Now high-quality music your will.\n\nWhat is the battery life?\n\nThese can be used for up to 6 hours of continuous music listening and are prtable enough to be carried wherever you go. Also they come with rechargeable battery and can be used even when being charged.\n\nWhat DAC chip has been used?\n\nThe WA11 comes with an ESS SABRE ES9018M DAC chip which delivers high-resolution audio output. These are created to deliver a balnced sound output without compromising on the overall quality.\n\nTo what frequency can these be used?\n\nThe WA11 works from 10 Hz to 200 kHz (-1 dB) frequency range. This means you can use it with the headphones that have low as well as high impedence and have no issues with the sound output.\n\nWarranty & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this Woo Audio WA11 Topaz comes with a 1 year warranty from Woo Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Woo Audio's warranty in India.\n\n\"If you’re in the market for an excellent transportable solution that drives any headphone under the sun, you have to give the WA11 a serious consideration.\"\nRead More\n\n\"The Woo Audio WA11 Topaz demonstrates extreme high-end sound in a portable size is possible.Wherever you go, the WA11 will bring out the best in your headphones.\"\nRead More\n\n\"The sound was the really impressive attribute here. With the added benefit of the remarkable Myspheres headphones, we were totally immersed in the music from the WA11 Topaz.\"\nRead More",
