  "description": "DESCRIPTION\n\nWHAT MAKES SPINFIT BETTER THAN YOUR AVERAGE SILICONE EARTIPS?\n\nSpinFit is a patented ear tip. It has an ergonomic concave design at the core to allow the ear tip to swivel, making it flexible to bend and twist to the contour of a person’s ear canal. The flexible nature, easy swivel and attractive colour options make it stand out form the average silicone eartips.\n\nERGONOMIC DESIGN FOR LONG LASTING COMFORT\n\nSpinFit are made up of premium soft silicon material along with ergonomic design which provides supreme and long lasting comfort.\n\nISOLATION OF THE HIGHEST ORDER\n\nThey have a consistent seal even for earphones with any insertion angle which gives the perfect noise isolation.\n\nTHE IDEAL, INEXPENSIVE UPGRADE\n\nSimple installation makes SpinFit an easy upgrade for your earphone and hence, they become a perfect replacement for your ear tips.\n\nSAME EARPHONES, BETTER SOUND\n\nIts enrichment on treble and bass ensures a superior listening experience to the foam and the ear tips.\n\nCompatibility Chart\n\nBRANDS\nCOMPATIBLE PRODUCTS\n\nJabra\n\nJabra Elite Active 65t, Jabra Elite Sport, Jabra Evolve 65t\n\nSennheiser\n\nMomentum True Wireless Bluetooth Earbuds\n\nAnker\n\nZOLO Liberty, Soundcore Liberty Neo, Liberty+\n\nSony\n\nWF-1000XM3, WF-1000X, Sony WF-SP700N\n\nB&O\n\nBeoplay E8 2.0, Beoplay E8 Motion\n\nSol Republic\nAmps Air 2.0, Amps Air Wireless, Amp Air 1.0\n\nPioneer\nC8 truly wireless, E8 truly wireless\n\nRHA\nTrueConnect\n\nNuForce\n\nBE Free6, BE Free5, BE Free8",
