  "description": "Designed & Made in Germany\n\nFlat Sound Signature\n\n2 Years of Warranty\n\nIdeal for Audiophiles\n\nFor Studio & Professionals\n\nIdeal for Indoor Use\n\nSemi Open-Back Design\n\nNeeds Amplification\n\n45mm Dynamic Drivers\n\nDESCRIPTION\n\nSUPERLATIVE AT EVERYTHING: IMPEDANCE, POWER AND SOUND DETAILING\n\nThe robust and dynamic neodymium magnets reproduce the quality sound Beyerdynamic is known for. This increased efficiency also leaves the DT 880 Edition with greater power reserves for precise linear response that is especially suited for high-achieving audio applications where succinct audio reproduction is of paramount importance, and dedicated equipment is available such as a headphone amplifier. The large 250-ohm voice coil provides unparalleled response clarity and increased impulse fidelity. The 250-ohm is the most widely used variant.\n\nSURREAL SOUNDSTAGE EXPERIENCE\n\nSoundstage is that spectrum of music that extends beyond your mind, and creates a sonic illusion of sorts. That is what the DT 880 Edition produces for you, effortlessly. Be it the driver units or the highly intelligible semi-open back design, that is the exact experience the Beyerdynamic DT880 Edition brings home.\n\nINCREASED FIDELITY AND SUPERIOR SONICS\n\nBeyerdynamic comes with the promise of dynamic transducer systems that are placed in their headphones. The over-achieving transducer systems only portray the amount of detailed engineering these headphones can boast of. Increased fidelity and performance is the one obvious feature of these specifically engineered headphones.\n\nSEMI-OPEN BACK DESIGN FORM-FACTOR\n\nThe DT 880 Edition semi-open, over-the-ear design offers slightly increased sound isolation and reduced noise leakage, while retaining the high fidelity normally associated with open-back headphones. The semi-open back also lets the headphones breathe which make the sound reproduced seem natural and enhances it to a great extent.\n\nADJUSTABLE HEADBAND, VELOUR EARPADS FOR ADDED COMFORT\n\nMindfully designed, the DT880 Edition comes with an adjustable headband, whose little notch is on the side. Move it to adjust the headband so that it firmly and comfortably cradles your head. The headband created with high-end strap-on leather, will only increase the comfort. The velour earpads are synonymous to bespoke luxury, and speak volumes of the comfort they provide. The build quality of the headphones has also been improved. The single-sided straight cable avoids getting tangled so that your music experience is compromised in no way.\n\nHIGHEST 'HIGHS' IN THE ROOM\n\nOne of the most noticeable features of these headphones is the treble they produce. Rapid and energetic, these over-ear headphones strive to achieve a high standard with higher frequencies, and do so with great elan. The mid range is clear and fine, and bespoke bass, these headphones make you feel closer to music. Solo voices and instruments appear highly defined and close to the listener.\n\nCHOOSE THE RIGHT VARIANT FOR YOU\n\n32Ω - The highly optimised 32 ohms variant is used for regular casual listening over laptops and smartphones. 250Ω - The 250 ohms is a wide choice for a stereo system at home. 600Ω - The 600 ohms is more ideal for hi-fi systems with especially powerful headphone outputs or special headphone amplifiers.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVER TYPE\nDynamic Driver\n\nMAGNET\nNeodymium\n\nIMPEDANCE\n32Ω/250Ω/600Ω\n\nSENSITIVITY\n96 dB @ 1 kHz\n\nFREQUENCY RESPONSE\n5Hz - 35,000Hz\n\nMAX INPUT POWER\n100 mW\n\nCONTROLS & CONNECTIVITY\n\nPLUG TYPE\nGold plated stereo jack plug (3.5mm) 1/4\" adapter (6.35mm)\n\nCABLE TYPE\n3m Straight\n\nMICROPHONE\nNo\n\nCOMPATIBILITY\nUniversal\n\nDESIGN & BUILD\n\nWEARING STYLE\nOver-ear\n\nWEIGHT\n290g\n\nGRILL\nClosed Back\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. Beyerdynamic - DT 880 Edition Headphones\n\n2. Jack adapter 6.35mm\n\n3. Leather storage bag Incl.Zipper\n\nBuying Guide\n\nBest Studio Monitoring Headphones\nby Abhijeeth Shetty May 09, 2020\nStudio monitoring headphones have what they call a flat sound signature. Meaning that they are intended to deliver audio that sounds as real as possible.\nRead More\n\nFAQs\n\nWhat is the warranty period on the Beyerdynamic - DT 880 Edition?\n\nThe warranty period on all Beyerdynamic products is 2 years. For more warranty details click here.\n\nDoes the Beyerdynamic - DT 880 Edition come with a mic?\n\nNo, the Beyerdynamic DT 880 Edition does not come with a mic since it is more of a studio monitoring headphone.\n\nHow is the overall fit?\n\nBeyerdynamic DT 880 Edition comes with an adjustable headband so that it firmly and comfortably cradles your head.\n\nDoes the Beyerdynamic DT 880 Edition have detachable cables?\n\nNo, it does not have a detachable cable.\n\nIs the Beyerdynamic DT 880 Edition good for long usage?\n\nYes, due to it being durable, lightweight and soft earpads make music listening for long hours comfortable.\n\nDoes the Beyerdynamic DT 880 Edition need an amplifier?\n\nYes, since the driver units are bigger, they will need an amplifier so that the headphones can perform to its full potential.\n\nWhich model is the best? DT 770 Edition, DT 880 Edition or DT 990 Edition?\n\nAll these models are similar in terms of their mechanical and audio quality. The numbers 770, 880, and 990 do not provide any indication of higher or lower quality. All these models do, however, differ significantly in their playback in terms of acoustic design and frequency response.\n\nWhat is the difference between Pro and Edition models of DT 770, DT 880, and DT 990?\n\nThe Pro series is designed for professional users and the Edition series are designed for end users. Also, the Pro and Edition series do not differ noticeably in terms of sound provided that they have the same impedance (e.g. the 250 ohms DT 880 Edition and the 250 ohms DT 880 Pro sound the same).\n\nIn which way do the different impedances of the DT 880 Edition and DT 990 Edition differ in terms of sound?\n\nThe differences in sound various between impedances are very slight and most people can only actually hear them when the sound is compared directly. They are, in any case, smaller than the differences between any one of these variants and competitor products. In general, it can be stated that the resolution and precision of the high mids and highs are slightly better at higher impedances. There are barely any differences worth mentioning apart from this.\n\nWhat is the technical difference between DT 880/990 edition and DT 880/990 Pro?\n\nThe corresponding variants with the same impedance sound the same. As the same transducer systems are used. The major difference is the edition models have a slightly softer headband for enjoying music at home while the Pro phones have a tighter fit onto the head for everyday work in the studio.\n\nHow can I tell what the impedance of my DT 770/880/990 Edition is?\n\nYou check the impedance of the integrated sound transducers from the connection plug. The impedance is sometimes hot embossed onto the plastic shaft of the plug: If there is nothing there, the model has an impedance of 250 ohms. If it reads 32 Ω, the model has an impedance of 32 ohms. If it reads 600 Ω, the model has an impedance of 600 ohms.\n\nWARRANTY AND MEDIA REVIEWS\n\n2 Year Warranty\nDon't sweat it, this Beyerdynamic DT 880 Edition comes with a 2 year warranty from Beyerdynamic that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Beyerdynamic's warranty in India.\n\n\"The DT 880 has excellent Mid range and an above-average Bass and Treble. Making them sound decently well balanced with instruments and vocals that don't feel pushed back or too forward on most tracks.\"\nRead More\n\n\"The DT880s are very comfortable, with their soft cushion and perfect grip. It is best headphones at this price point offer greater vim and vigour, but the Beyerdynamics remain an entertaining listen.\"\nRead More",
