  "description": "Chi-Fi Excellence\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nIdeal for Indoor Use\n\nESS Sabre ES9038Q2M\nDAC Chip\n\nConnect With USB Optical, Coaxial & RCA\n\nPair with Laptop via USB\n\n560mW @ 32Ω Power Output\n\nMetal Build\n\nVolume Controls\n\nDESCRIPTION\n\nMEET THE AUNE AUDIO X1S PRO\n\nThe 7th generation of the X1 range, the X1s Pro comes with an ES9038Q2M DAC with 3 filters and decoding capabilities up to PCM 768kHz and DSD512. This high-performance DAC can connect to just about any device (including your phone!) and has been tuned based on musical instruments so that you enjoy and natural and realistic audio playback.\n\nAMP IT UP WITH A 5TH GEN CLASS-A CIRCUIT\n\nThe amplification system within the Aune X1s Pro is based on a 5th Gen Class-A circuit. These are able to deliver with a power of 550mW under 32Ω, immense precision and sound richness, that can be used with almost all the headphones AND IEMs available today. At the touch of a button, you can adjust the timbre using 3 different filters: Fast roll-off, Slow roll-off and Apodizing fast filter.\n\nCONNECT TO ANY DEVICE OF YOUR CHOICE\n\nThe Aune X1s Pro comes with Coaxial S/PDIF, Toslink Optics and a line input in stereo RCA format along with USB-B input. Connect your HiFi devices directly with the X1s Pro to enjoy your music without the need for a computer. You can use it as an external DAC with a USB computer to significantly improve the sound quality of your machine. On the output side, it offers a 6.35mm jack output on the front panel and an RCA on its rear panel to connect a headset.\n\nA UNIQUE ARCHITECTURE FOR EXCELLENT PERFORMANCE\n\nThe Aune Audio X1s Pro is designed with a unique architecture that separates digital and analogue circuits while having a powerful voltage regulation system that improves the overall dynamics and sound image. This delivers excellent performance measurement with an ultra-low noise of 3.5µV, a THD+N that is also well placed at -102dB and a dynamic range of 117dB.\n\nSPECS\n\nSPECIFICATIONS\n\nDAC CHIP\nES9038Q2M\n\nINPUTS\n1x USB-B 1x Coaxial S/PDIF 1x Optical Toslink\n\nOUTPUTS\n1x RCA Stereo 1x Jack 6.35mm\n\nSUPPORTED SAMPLING RATES\nUSB : PCM up to 32bit 768kHz, DSD up to DSD512\n\nOptical : PCM up to 24bit 192kHz, DoP64\n\nCoaxial : PCM up to 24bit 384kHz, DoP up to DoP128\n\nRCA OUTPUT LEVEL\n2Vrms\n\nRCA OUTPUT FREQUENCY RESPONSE\n20Hz - 20kHz (+/-0.2dB)\n\nSNR\n117dB\n\nTHD+N @ 1kHz\n-102dB\n\nOUTPUT POWER\n560mW @ 32Ω (0.1% @ 1kHz 0dB)\n\nIN THE BOX\n\nBOX CONTENTS\n1. Aune X1s Pro Headphone Amplifier\n\n2. Power adapter\n\n3. Male Jack 6.35mm to female Jack 3.5mm adapter\n\n4. USB cable\n\n5. disk (with E-Manual and driver inside)\n\n6. User manual\n\nCOMPARISONS\n\nAune Audio X1s Pro\n\n₹ 19,999/- SEE MORE\n\niFi Audio - Hip DAC\n\n₹ 12,999/- SEE MORE\n\nSchiit - Fulla 3\n\n₹ 10,999/- SEE MORE\n\niFi Audio - Zen DAC\n\n₹ 11,999/- ₹ 13,999/- SEE MORE\n\nWarranty\n\nIdeal For\nDesktop\nSmartphone\nDesktop\nDesktop\n\nWeight\n\n125g\n9oz\n0.8kg\n\nDAC Chip\nES9038Q2M\nBurr Brown\nAKM AK4490\nBurr Brown\n\nSample Rate\n32bit/768kHz\n32bit/384kHz\n16/44.1kHz\n32-bit/384kHz\n\nInbuilt Battery\n\nBattery Life\n\n8 Hours\n\nBalanced Outputs\n\nOutputs\n6.35mm & RCA\n4.4mm & 3.5mm\n3.5mm & RCA\n4.4mm, 3.5mm, RCA\n\nDigital Inputs\nUSB, Optical, Coaxial, Line In\nUSB 3.0\nMirco USB\nUSB3.0 B\n\nOutput level\n32ohms@560mW\nUnbalanced: 280mW@32 Ohm Balanced: 400mW@32 Ohm\n250mW@32ohm\n4.4mm 330mW@32 Ohm S-BAL 230mW@32 Ohm;\n\nSignal to Noise Ratio\n117dB\n\n105dB\n116dB\n\nMQA Support\n\nVolume Control\n\nExpert Verdict\n\"Aune does good work. We all can agree, the X1S is a good DAC that offers a solid selection of possibilities. We can recommend this to middle-tier powered speaker owners foremost.\" Headfonics\n\n\"I love its ability to drive full-size headphones with enthusiasm. If you’re looking for a lightweight DAC/Amp to improve the audio from your laptop or mobile this is a no-brainer.\" Hifi Trends\n\n\"The iFi Zen Dac is one of the best entry-level DACs you can buy. It sounds great, has a ton of features, and can grow with your system as your tastes evolve.\" Tech Radar\n\nSEE MORE\nSEE MORE\nSEE MORE\nSEE MORE\n\nFAQs\n\nWhat is the warranty like on the Aune Audio - X1s Pro?\n\nThe warranty period of the Aune Audio - X1s Pro is of 1 years. In order to claim warranty, please visit our Aune Audio Warranty Page We are very helpful guys, just saying.\n\nWhat are all the outputs supported by Aune Audio - X1s Pro?\n\nIt supports a 6.35mm jack output on the front panel and an RCA on its rear panel to connect a headset.\n\nWhich DAC chip does the Aune Audio - X1s come with?\n\nThe Aune Audio - X1s features an ESS Sabre Es9038Q2M DAC Chip. This high-performance DAC can connect to just about any device (including your phone!) and has been tuned based on musical instruments so that you enjoy natural and realistic audio playback.\n\nWhat else do I get in the box?\n\nAlong with the Aune Audio - X1s you get Power Supply, Male Jack 6.35mm To Female Jack 3.5mm Adapter, USB Cable & CD With Drivers.\n\nHow is the overall built quality of Aune Audio - X1s Pro?\n\nThe Aune Audio - X1s Pro is built to be durable and stylish with its CNC-processed aluminium body. The markings have been laser engraved so that they don't fade away. Pretty sturdy huh!\n\nWARRANTY & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this Aune Audio X1s Pro comes with a 1 year warranty from Aune Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Aune Audio's warranty in India.\n\n“Aune does good work. We all can agree, the X1S is a good DAC that offers a solid selection of possibilities. We can recommend this to middle-tier powered speaker owners foremost.” Read More",
