  "description": "DESCRIPTION\n\nTHE PERFECT UPGRADE CABLE FOR YOUR MEZE EMPYREAN\n\nUpgrade the sound quality of your Meze Empyrean with the Meze Empyrean 4.4mm Balanced PCUHD Upgrade Cable. This cable is made from braided Furukawa PCUHD copper with 0.04 mm*140 conductors in 8 wire to 4 wire. It terminates in a 4.4mm plug on one end and 4-pin mini-XLR headphone connectors on the other. A US-made TPE sleeve covers the cable and prevents microphonics.\nPS: PCUHD stands for pure copper ultra-high drivability. It has 99.99% oxygen-free copper (5 ppm or less).\n\nSPECS\n\nBUILD AND DESIGN\n\nCABLE TYPE\n4.4 mm balanced cable\n\nMATERIAL USED\nBraided Furukawa PCUHD copper\n\nOxygen free copper purity is 99.99% (5 ppm or less)\n\nJensen 4% silver Soldering\n\nUSA made TPE Sleeve\n\nCABLE LENGTH\n1.2 m (3.9 ft) long\n\nIN THE BOX\n\nBOX CONTENTS\nMEZE - Empyrean 4.4mm Balanced PCUDH Upgrade Cable\n\nWarranty & Media Reviews\n\n6 Months Warranty\nDon't sweat it, this Meze Empyrean 4.4mm Balanced PCUHD Upgrade Cable comes with a 6 months warranty from MEZE that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Meze's warranty in India.",
