  "title": "Campfire Audio - Andromeda (2020)",
  "id": "585771417663",
  "description": "Designed & Made in USA\n\nBalanced Sound Signature\n\n2 Years of Warranty\n\nIdeal for Audiophiles\n\nBest Suited for Portable Use\n\nMetal Build\n\n5 Balanced Armature Drivers\n\nTangle Resistant Litz Cables\n\nReplaceable MMCX Cables\n\nThe Andromeda is an absolute legend. Everyone loves them. But for different reasons. Some love its Bass and slam. Some love their picture-perfect imaging. Some love the delicate balance between musicality and detail. Some love it for being the iconic green monster.\n\nRAGHAV SOMANI\nHeadphone Guru\n\nAbout Raghav Somani\nRaghav Somani is the Founder & CEO of Headphone Zone. An avid audiophile and musician since 2008, his choice of headphones include STAX Electrostats, Audeze LCD 3, and for music on the go, the JH Audio Roxanne + Astell&Kern SP1000 is never too far away. On his playlist, you'll find A.R. Rahman, Michael Jackson, and the Eagles.\n\nDESCRIPTION\n\nA NEW CHAPTER OF YOUR BELOVED ANDROMEDA\n\nThe Andromeda 2020 is an upgrade to one of the most beloved earphones. It features Campfire Audio's solid-body design which was used in their custom-fit range and is now being used in the Universal Fit line to enhance it. This method gives new levels of control to the acoustic design. Elevate your music listening experience with all-new Andromeda 2020 which has fine-tuned musical representation, audio accuracy and better resolution.\n\nDURABLE DESIGN WITH SIGNIFICANT SONIC ENHANCEMENTS\n\nThe exterior of the all-new Andromeda 2020 is pretty much the same as the previous versions with its classic angular silhouette and emerald-green finish. A single printed body contains all internal components and is designed to elevate the sonic performance. These earphones showcase the best of engineering, doing the heavy lifting with fewer moving parts which ultimately leads to reliable reference performance.\n\nCLASSIC SOLID GREEN WITH A NEW SPOUT\n\nThe latest spout design keeps its unique short collar while adding the signature grill pattern that helps keep the earphone debris-free. The Andromeda 2020 have zirconium blasted aluminium shells with the classic emerald green anodizing which are exclusively designed by Campfire Audio.\n\nCORK ZIPPER CASE THAT KEEPS THE ENVIRONMENT & YOUR ANDROMEDA SAFE\n\nThe Andromeda 2020 comes with an environment-friendly premium cork protective zipper case. It is designed with sustainably harvested cork which is surrounded by a durable rubber barrier. The interior is lined with a faux wool lining to safeguard the earphones while on-the-move. Additionally, the cork is naturally durable and feels good when you hold it in your hand. Each of these cases is developed by skilled and committed craftspeople in Portugal.\n\nSpecs\n\nAUDIO SPECIFICATIONS\n\nDRIVERS\n5 Balanced Armature Drivers + T.A.E.C\n\nDRIVER TYPE\nBalanced Armature Drivers\n\nIMPEDANCE\n12.8 Ohms\n\nSENSITIVITY\n94 dB SPL @ 1kHz: 7.01 mVrms\n\nFREQUENCY RESPONSE\n10Hz–28 kHz\n\nMAGNET TYPE\nNeodymium\n\nCONTROLS & CONNECTIVITY\n\nWIRED CONNECTIVITY\n3.5mm\n\nMICROPHONE\nNo\n\nCOMPATIBILITY\nUniversal\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nCABLE TYPE\nSmoky Litz Copper Cable\n\nIN THE BOX\n\nBOX CONTENTS\n1. Campfire Audio Andromeda 2020 Earphone\n\n2. Campfire Audio Sustainable Cork Earphone Case. Dyed Green. Made in Portugal.\n\n3. Campfire Audio Litz Cable\n\n4. Silver Plated Copper Conductors with Berylium Copper MMCX and 3.5mm Stereo Plug\n\n5. Final Audio Tips (xs/s/m/l/xl)\n\n6. Campfire Audio Earphone Tips(s/m/l)\n\n7. Silicon Earphone Tips (s/m/l)\n\n8. Campfire Audio Lapel Pin\n\n9. Cleaning Tool\n\nFAQS\n\nWhat is the warranty period on Campfire Audio and how to claim warranty?\n\nCampfire Audio products come with a 2 year warranty period. To claim warranty read more here.\n\nWhat is the cable like?\n\nThe Andromeda 2020 has a Smoky Litz cable with silver-plated copper conductors. This is covered in a medical grade PVC jacket for added durability and tangle-resistance.\n\nDoes Andromeda 2020 have a remote and mic?\n\nNo, the Andromeda 2020 believes in minimalism. Also, what is a remote when compared to the gorgeous sound it offers\n\nWhat is the driver configuration for Campfire Audio Andromeda?\n\nThe Andromeda 2020 has a 5 driver configuration. It comes with 5 Balance Armature Drivers.\n\nWhat is the sound signature of Campfire Audio Andromeda 2020?\n\nThe Campfire Audio Andromeda 2020 delivers a Balanced sound signature.It is detailed, analytical, and intense in its listening experience.\n\nDo you get a carry case in the box?\n\nYes, it does come with a small carrying pouch.\n\nDoes the Campfire Audio Andromeda 2020 come with detachable cables?\n\nYes, the Andromeda 2020 comes with detachable MMCX connectors. That means you can replace the stock cable with a balanced cable to open up the sound further.\n\nDo you need an amplifier to drive these?\n\nIt is not recommended to get an amplifier as these are sensitive earphones. However, you can pair this up with a Hi-Res Player to take your music listening experience to the next level. Check out our collection here.\n\nBuying Guide\n\nTop 10 Best Audiophile IEMs of 2020\nby Abhijeeth Shetty May 09, 2020\nRead this article to see a list of some of the best audiophile earphones available in the market.\nRead More\n\nHeadphone Zone Festive Gift Guide for 2020\nby Abhijeeth Shetty October 14, 2020\nThis festive season, lighten up your life with awesome sound and celebrate with good music. Have a good one and stay safe.\nRead More\n\nWarranty & Media Reviews\n\n2 Year Warranty\nDon't sweat it, this Campfire Audio Andromeda 2020 comes with a 2 year warranty from Campfire Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Campfire Audio's warranty in India.\n\n\"It is a musically driven u-shaped response. Do not expect it to be a neutral color free experience, but it’s fantastically fun to listen to and the details are all there in a very spacious setting.”\nRead More\n\n\"There is no doubt that Campfire Audio has done a remarkable job creating the Andromeda. Commends that end fast are simply hypes, while the ones that last long are like letters of guarantee.\"\nRead More\n\n\"More engaging than Jupiter, but still erring chalkily rather than wetly emotional. There is so much space in Camofire Audio Andromeda’s mids and high mids.\"\nRead More\n\n\"They're not the last word in detail, but the Andromeda's make up for that with engaging performance, delivering a big musical sound. Confident, musical performance, Impressive bass, Comfortable fit”\nRead More\n\n\"The Campfire Audio Andromedas have high-end looks and a range of great finishes, Clear treble, Ultra-sensitive, Fine build\"\nRead More\n\n\"It is pricey for an earphone but given the scope of its abilities as a transducer it’s, comparatively at least, a bargain. Ladies and Gentlemen, meet the new Best in Class.\"\nRead More",
