  "description": "Designed in Romania\n\nBalanced Sound Signature\n\n2 Years of Warranty\n\nIdeal for Audiophiles\n\nBest Suited for Portable Use\n\nMetal Build\n\n1 Dynamic + 4 BA Drivers\n\nReplaceable MMCX Cables\n\nDESCRIPTION\n\nTHE PERFECT IEM FOR THE TRUE AUDIOPHILE\n\nThe Meze Rai Penta is a high-end audiophile IEM that works effortlessly with any source device due to its low impedance and high sensitivity. It has high-quality sound and the perfect build with its smart, unique and ergonomic housing. This IEM consists of 4 balanced drivers and 1 dynamic driver making it the perfect sonic combination. Enjoy detailed sound, natural tonality and consistent fit.\n\n5 DRIVER CONFIGURATION FOR POWERFUL PERFORMANCE\n\nThe hybrid technology of the Rai Penta delivers harmonized sound frequencies without the overlay of phase issues. The sound has to pass from the housing to the nozzle and finally to the eartips to reach your eardrums. To make this seamless, the precise length of each sound tube has been created to determine the air volume in front of each driver so that the 5 drivers work smoothly and deliver pure sound.\n\nTHE PERFECT DESIGN FOR DETAILED SOUND\n\nMost multi-driver configurations use an imperfect plastic tube and dampener system that result in interference. The Rai Penta's driver does away with this design for clean, pure sound. It delivers a balanced sound signature and also provides extreme detailing to every tune, within a frequency range from 4Hz to 45 kHz. Moreover, you can drive it with just about any and every source device.\n\nCNC ALUMINIUM CHASSIS FOR DISTURBANCE-FREE SOUND\n\nThe finely tuned PES design in front and behind the driver assembly helps in controlling the internal chamber pressure by regulating the airflow. For the sound to be directed to your ears without any disturbance, the CNC aluminium chassis is milled from solid aluminium to create a perfect space for it. The milled logo on the high-endurance anodised surface shows the aluminium material under the anodizing.\n\nANATOMICAL, ERGONOMIC DESIGN FOR LONG LISTENING SESSIONS\n\nMeze has designed the Rai Penta's housings to be durable, comfortable and easy to use. The rounded edges are designed to mimic the natural curves of the human ear for a more secure and comfortable fit. It's purely made for the true audiophile to spend hours and hours listening to this beauty.\n\nHIGH-QUALITY CABLES AND CONNECTORS\n\nThese IEMs have been designed with high-purity silver-plated copper wires and use finely crafted metal plugs shells. This ensures that the assembled cables are strong enough for a long time. Each of the 4 wires consists of 20 Litz strands. For the best connectivity and durability, the MMCX plugs are crafted from high-quality materials including a rhodium-plated plug termination.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVERS\nPenta-Hybrid Drivers\n\n4 x Customized Balanced Armature 1 x Dynamic Driver\n\nIMPEDANCE\n20 Ω\n\nSENSITIVITY\n110 dB spl/1mW Sensitivity\n\nFREQUENCY RESPONSE\n4 Hz - 45 kHz\n\nDISTORTION\nless than 1%\n\nCONTROLS & CONNECTIVITY\n\nWIRED CONNECTIVITY\n3.5mm Input\n\nMMCX connector\n\nCOMPATIBILITY\nUniversal\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nCABLE\n2.5mm Balanced Cable, 3.5mm connector\n\nIN THE BOX\n\nBOX CONTENTS\n1. In-Ear headphones\n\n2. Hard Case: protective EVA case with Meze Audio metal logo\n\n3. 4 pairs of soft silicone eartips XS, S, M, L\n\n4. MMCX braided cables made of silver plated copper custom wires ending in high quality 3.5mm\n\n5. 1 double flanged eartips\n\n6. 2 deep insertion double flanged eartips\n\n7. 1 pair of comply foam eartips\n\n8. 3.5mm to 6.3mm adapter\n\n9. Airplane 2 pin adapter\n\n10. Cleaning tool\n\nFAQs\n\nWhat is the warranty period on Meze and how do I claim it?\n\nThe warranty period on all Meze Audio products is 2 years. Read more about Meze warranty.\n\nWhat is the cable like?\n\nThese IEMs have been designed with high-purity silver-plated copper wires and use finely crafted metal plugs shells.\n\nDoes the Meze Rai Penta come with an inline microphone?\n\nNo, the Rai Penta believes in minimalism. Also, what is a remote when compared to the gorgeous sound it offers.\n\nWhat is the driver configuration on Meze Rai Penta?\n\nThe Rai Penta has a 5 driver configuration. It comes with 4 Balance Armature Drivers and 1 Dynamic Driver.\n\nDoes the Rai Penta come with a carry case?\n\nYes, it does come with a protective hard pouch.\n\nDoes the Rai Penta come with detachable cables?\n\nYes, the Rai Penta comes with detachable MMCX connectors. That means you can replace the stock cable with a balanced cable to open up the sound further.\n\nDo you need an amplifier to drive these?\n\nIt is not recommended to get an amplifier as these are sensitive earphones. However, you can pair this up with a Hi-Res Player to take your music listening experience to the next level. Check out our collection here.\n\nBUYING GUIDE\n\nTop 10 Best Audiophile IEMs of 2020\nby Abhijeeth Shetty May 09, 2020\nIf you are set to know about some of the best audiophile earphones available out there check out the list of best earphones for audiophiles listed below.\nRead More\n\nWarranty & Media Reviews\n\n2 Year Warranty\nDon't sweat it, this Meze Rai Penta comes with a 2 year warranty from Meze that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Meze's warranty in India.\n\nGrand Prize - IEM's\nVGP Lifestyle Award May, 2019\n\nGold IN-EAR MONITER Award\nMajorHiFi July, 2019\n\nWriter's Choice Award\nHeadphone Guru Nov, 2019\n\nEditor's Choice Award\nInnerfidelity Dec, 2019\n\nBest IN-EAR MONITER Award\nHeadfonia Award Dec, 2020\n\nEditors' Choice Award\nHi-FI+ Award April, 2020\n\nIn-Ear Monitor Award\nVGP Lifestyle Award May, 2020\n\nChoice Recommended\nHi-Fi Award Aug, 2021\n\nInnovation Awards 2021\nhifi+ Sound Investment Oct, 2021\n\nHighly Recommended\nHifi And Music Source July, 2021\n\n\"Personally, I adore the harmonic balance and timbre of the Rai Penta throughout. It sounds very natural without too much warmth or sharpness.\"\nRead More\n\n\"After the award-winning Empyrean, Antonio Meze and his team have done it again. The 5 driver Rai Penta isn’t only comfortable, it looks beautiful and sounds like a high-end IEM should sound.\"\nRead More\n\n\"It has a beautiful, harmonically complex, and natural sound with a little bit of a bass bump for extra impact. Additionally, it fits extremely easily in the ears.\"\nRead More\n\n“It is a product that shows off it’s subtle refinement over long listening sessions and deep critical listening that quickly digresses into ‘lost in the music’ time.\"\nRead More\n\n“I place these in my highest category, Pretty Awesome. You get a fantastic bang for your buck with these IEM’s. To summarize, the tone, bass, clarity, precision are all hitting above their weight class.\"\nRead More\n\n\"If I had to summarize this listening and the discovery of Meze Rai Penta in very few words, I would simply say: splendid, with magical moments.\"\nRead More\n\n\"What the Rai Penta delivers are impressive dynamics and a level playing field for all the frequencies. Their transparency allows them to play well with all genres and bring out the best in all of them.\"\nRead More\n\n\"What the Rai Penta delivers are impressive dynamics and a level playing field for all the frequencies. Their transparency allows them to play well with all genres and bring out the best in all of them.\"\nRead More",
