  "description": "DESCRIPTION\n\nAMP-UP YOUR MUSIC LISTENING EXPERIENCE\n\nThe iBasso AMP3 has a balanced amplification circuit design, which has a positive and a negative signal. It reaps the benefits of having both—current and voltage feedback along with OPAMP+BUF architecture that's optimised for high voltage demand. They all work together to reduce the harmonics, including both, odd and even harmonics as it keeps the sound full and musical.\n\nOFFERS 7-8 HOURS OF BALANCED SOUND\n\nThis amp module pairs seamlessly with the iBasso DX series giving you an average of 7-8 hours of playtime without needing any charge. The playtime differs with varied sample/bit rates & headphone/IEM loads. The AMP3 comes with two 2.5 mm output channels: Phone Out & Line Out.\n\nSPECS\n\n2.5mm PHONE OUT\n\nOUTPUT VOLTAGE\n6Vrms\n\nSN\n124 dB\n\nFREQUENCY RESPONSE\n10Hz-45KHz - 0.5dB\n\nTHD+N\n0.00025%, -112dB (32 ohms@2.4Vrms)\n\nDNR\n124 dB\n\nCROSSTALK\n-123dB\n\n2.5mm LINE OUT\n\nOUTPUT VOLTAGE\n6Vrms\n\nFREQUENCY RESPONSE\n10Hz-45KHz - 0.5dB\n\nTHD+N\n0.00022%, -113dB\n\nSN\n124dB\n\nCROSSTALK\n-114dB\n\nCONNECTIVITY\n\nAVERAGE PLAY TIME\n7.5 hours (The play time varies with different sample rate/bit rates, and headphone/IEM loads.)\n\nIN THE BOX\n\nBOX CONTENTS\n1. iBasso - AMP3\n\nWARRANTY & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this iBasso AMP3 comes with a 1 year warranty from iBasso that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about iBasso's warranty in India.\n\n\"The AMP3 really delivers a natural analog type sound and it is super hard to believe that this is a Sabre DAC delivering the signal. Its almost tube-like response.\"\nRead More\n\n\"The iBasso AMP3 module is an excellent upgrade to your iBasso DX200 if you want more extension on both ends and extra clarity in the midrange.\"\nRead More\n\n\"iBasso Audio’s AMP3 is the right choice of module for everybody who feels to be in need of a balanced 2.5 mm TRRS headphone output but wants a little more “organic-ness” and perceived impact.\"\nRead More",
