  "description": "Designed in Japan\n\nFlat Sound Signature\n\n3 Years of Warranty\n\nIdeal for Audiophiles\n\nIdeal for Stage & Live Shows\n\nWorks with Android & iOS\n\nDynamic Drivers\n\nTangle-Free Cables\n\nReplaceable Cables\n\nDESCRIPTION\n\nPROPRIETARY DUAL PHASE PUSH-PULL DRIVERS\n\nThe Audio Technica - ATH-E40 has proprietary dual phase push-pull drivers for pure sound reproduction that is natural and not artificial at all. It aims to deliver unaltered, clean sound straight to you.\n\nONE FOR THE STUDIOS\n\nThe Audio Technica - ATH-E40 is designed to fit and seal within your ear for the ultimate in-ear monitoring. Whether you're on-stage or on-the-go, these IEMs will stay in and provide perfect noise isolation.\n\nDETACHABLE CABLES AND A2DC CONNECTORS FOR CONVENIENCE\n\nThe Audio Technica - ATH-E40 has robust detachable cables and A2DC Connectors improves fit that adds convenience by making them easily replaceable when required.\n\n4 SIZES OF EARTIPS FOR THE RIGHT FIT\n\nThe Audio Technica - ATH-E40 comes with silicone ear tips in four different sizes. A carry case is also included for protection, storage and easy transport.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nDRIVER TYPE\nDual Phase Push-Pull\n\nIMPEDANCE\n12 Ohms\n\nSENSITIVITY\n107dB\n\nFREQUENCY RESPONSE\n20Hz - 20,000Hz\n\nMAGNET TYPE\nNeodymium\n\nCONTROLS & CONNECTIVITY\n\nWIRED CONNECTIVITY\n3.5mm Input\n\nMICROPHONE\nNo\n\nCOMPATIBILITY\nUniversal\n\nDESIGN & BUILD\n\nWEARING STYLE\nIn-Ear\n\nCABLE TYPE\n1.6 m Detachable\n\nWEIGHT\n10g (Without Cable)\n\nIN THE BOX\n\nBOX CONTENTS\n1. Audio Technica - ATH-E40\n\n2. Carry Case\n\n3. Silicone eartips\n\nCOMPARISONS\n\nAudio-Technica - ATH-E40\n\n₹ 6,499/- ₹ 9,613/- SEE MORE\n\nMEE Audio - MX2 Pro\n\n₹ 7,999/- ₹ 9,999/- SEE MORE\n\nTIN HiFi - T4\n\n₹ 6,999/- ₹ 10,999/- SEE MORE\n\nEtymotic - MK5\n\n₹ 6,499/- ₹ 6,999/- SEE MORE\n\nWarranty\n\nSound Signature\n\nFlat\n\nBalanced\n\nBalanced\n\nFlat\n\nMicrophone\n\nDriver Type\nDynamic\nHybrid\nDynamic\n\nDriver Configuration\n1x DD\n1x DD 1x BA\n1x DD\n\nSensitivity\n107dB\n104±3db\n102 ±3dB\n95dB\n\nImpedance\n12Ω\n34Ω\n32Ω\n32Ω\n\nCompatibility\nAndroid & iOS\nAndroid & iOS\nAndroid & iOS\nAndroid & iOS\n\nDetachable Cable\n\nConnector\nA2DC\n\nMMCX\n\nIn The Box\nAudio Technica ATH-E40 3 Pairs Of Silicone Ear Tips Carry Case\nMX2 PRO In-Ear Monitors Stereo Audio Cable Stereo Headset Cable Carrying Case With Carabiner Comply™ Memory Foam Eartips Silicone Eartips (4 Pairs) Shirt Clips (2 Pairs) ¼” (6.3mm) Adapter\nTIN HiFi T4 Earphones 3 Pair X Red Bore Silicone Tips (S/M/L) 3 Pair X Grey Colored Silicone Tips (S/M/L) 1 Pc X Storage Carry Box\nEtymotic - MK5 ACCU Fit™ Eartips Shirt Clip Pouch\n\nExperts Verdict\n\"ATH E40 is a very good earphone, and churns out superb detail in a wide soundstage. It has this coloured tone in a balanced signature, with good musicality and bass, making it a very unique.\" Head - Fi\n\n\"Professional IEMs created for musicians, that can be used not only on sage. All models, including senior, are rather good for casual listeners that want to get quality sound and other bonuses.\" Porta Fi\n\n\"The T4 sounds and feels like a major in-ear: a clean shape with sturdy construction and the right amount of sophistication, combined with one the best dynamic driver you can find in this price range.\" Headfonia\n\nThe Etymotic MK5 are classy earphones that are a great choice for those who can’t afford to spend a extra on the company’s more expensive earphones. Trusted Reviews\n\nSEE MORE\nSEE MORE\nSEE MORE\nSEE MORE\n\nFAQs\n\nWhat is the warranty period on Audio Technica ATH E40 and how do I claim warranty?\n\nThe warranty period is 3 Years from the date of invoice for all M-Series and E-Series (Pro Products). In order to claim warranty, please visit our Audio-Technica warranty page Audio-Technica warranty page. We are very helpful guys, just saying.\n\nHow comfortable is the Audio Technica ATH E40?\n\nSince the Audio Technica ATH E40 is an in the ear product so it depends on your ear size and which earbud fits you perfectly for which the brand provides a variety of eartips.\n\nWhich Comply series will work with my Audio-Technica - ATH-E40?\n\nThe Comply - Variety Pro Pack - Sports Pro / Audio Pro is compatible with your Audio-Technica - ATH-E40.\n\nDoes the Audio-Technica - ATH-E40 come with noise cancellation?\n\nNo, but it is spefically engineered to improve noise isolation which reduces the ambient sound to a certain limit.\n\nWill I be happy with how Audio-Technica - ATH-E40 sound?\n\nAudio Technica ATH E40 provides a powerful bass along with a balanced mid and high range to give a detailed sound on stage or while casual listening.\n\nDoes the Audio-Technica - ATH-E40 come with a Mic?\n\nNo,the Audio Technica ATH E40 does not include a mic. Kind of a bummer, ain't it?\n\nAre the cables detachable?\n\nYes, these earphones come with the option to change wires as per your desire or when not in use.\n\nDoes the Audio-Technica - ATH-E40 come with a carry pouch?\n\nYes, the Audio-Technica - ATH-E40 does come with a leather case. Did you just smile?\n\nIs the amplifier required to drive the Audio-Technica - ATH-E40?\n\nNo, the Audio-Technica - ATH-E40 does not require an amplifier. However, you can pair it up with a Hi-Res player to enhance your music experience.\n\nWARRANTY AND MEDIA REVIEWS\n\n3 Year Warranty\nDon't sweat it, this Audio-Technica ATH-E40 comes with a 3 year warranty from Audio-Technica that covers manufacturing defects. You get 1 year manufacturer warranty straight out of the box and can avail an additional 2 year warranty by registering the product. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Audio-Technica's warranty in India.\n\n\"If you are used to using high-quality audio tracks, and want a pair that are neutral through the range, the ATH-E40 is, tonally speaking, the best pair of in-ear headphones.\"\nRead More\n\n\"The first thing I notice when listening to these headphones, is a fantastic level of separation. The ATH-E40 is an articulate earphone with a pretty amazing sound.\"\nRead More\n\n\"ATH E40 is a very good earphone, and churns out superb detail in a wide soundstage. It has this coloured tone in a balanced signature, with good musicality and bass, making it a very unique.\"\nRead More\n\n\"They are best suited for those who really care for the music they enjoy. The Audio Technica E40’s are a music listener’s earphones, not really aimed at the casual listener.\"\nRead More",
