  "id": "1733672206399",
  "description": "Designed in the UK\n\n1 Year of Warranty\n\nIdeal for Casual Music Listening\n\nIdeal for Movies and TV\n\nIdeal for Commuting\n\nUse Wirelessly with Bluetooth\n\nWireless Range of 10m\n\nMulti-point Connection\n\nVolume Controls\n\nDESCRIPTION\n\nDynamic Larger Than Life Sound\n\nThe Stanmore II from Marshall is a compact sized speaker which does not fail to produce amazing sound and is perfect for any room, big or small. Built with advanced components, it produces clean and precise audio, even at the highest levels. You will experience deep and powerful bass throughout the midrange and on to the highest of highs. The sound will drive you crazy with its overall effect.\n\nCustomize Bass and Treble as per your Favorite Song\n\nControl the bass, analog treble, and volume knobs so you hear the music just the way you like it. Just use the Marshall Bluetooth app or the analog controls on your speaker’s top panel to perfect your sound according to the room you’re in.\n\n3.5 mm & RCA Input\n\n3.5mm input is a popular modern day input method which connects to any device. But the Marshall Stanmore II speaker lets you go to analog and connect devices which may be rolling in dust in your basement. Now, clean all the dust from the CD player or turntable and connect via the RCA input. You can also use the cable for any Sonos unit.\n\nMassive Frequency Range\n\nThe Stanmore II speaker from the product line of Marshall offers a huge frequency response of about 50-20 000Hz. IT produces clean and precise audio, even at the highest levels, due to advanced components such as two 15 watt class D amplifiers powering its tweeters and a 50 watt class D amplifier to drive its mighty subwoofer.\n\nRock ‘n’ Roll Design\n\nThe Marshall Stanmore II speaker is an example of Rock ‘n’ Roll days classic design. The entire look of the speaker feels sophisticated. The analog interaction knobs on with a metallic finish adds to the beauty of the product. The best features are the vintage looking design of the front fret, gold-colored metal details, and the script logo.\n\nHook it up Wirelessly with Bluetooth 5.0 & aptX technology®\n\nLife becomes easier without wires. The Bluetooth 5.0 provides a superior wireless sound at a range of up to 30 feet (10 metres) while maintaining connectivity. Connect to the speaker with the mobile app on your smartphone, tablet or computer to stream music directly to your speaker with no wires required. This speaker features multi-host functionality so you can easily connect and switch between two Bluetooth devices seamleassly.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nPOWER AMPLIFIERS\nOne 50 Watt Class D amplifier for the woofer Two 15 Watt Class D amplifiers for the tweeters\n\nCABINET PRINCIPLE\nBass-reflex\n\nMAXIMUM SOUND PRESSURE LEVEL\n101 dB @ 1 m\n\nFREQUENCY RANGE\n50-20 000Hz\n\nADJUSTABLE BASS AND TREBLE CONTROLS\nFine tune your music using the analogue controls on your speaker\n\nSTEREO/MONO\nStereo\n\nCONTROLS & CONNECTIVITY\n\nWIRELESS CONNECTIVITY\nBluetooth 5.0 with Qualcomm aptX\n\nWIRED CONNECTIVITY\n3.5 mm Input RCA Input\n\nTOP PANEL CONTROLS\nBass control knob Play/pause button Power lever Source button Treble control knob Volume control knob\n\nPHYSICAL UNIT\n\nDIMENSIONS\n350 x 195 x 185 mm / 13.78 x 7.68 x 7.28 in\n\nWEIGHT\n4.65 kg\n\nCOLOURWAYS\nBlack / White\n\nPOWER\n\nMAINS INPUT VOLTAGE\n100 - 240 V\n\nMAINS FREQUENCY\n50 - 60 Hz\n\nIN THE BOX\n\nBOX CONTENTS\n1. Stanmore II Bluetooth speaker\n\n2. Legal and safety information\n\n3. Mains lead\n\n4. Quick start guide\n\nWARRANTY\n\n1 Year Warranty\nDon't sweat it, this Marshall Stanmore II comes with a 1 year warranty from Marshall that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Marshall's warranty in India.",
