  "description": "DESCRIPTION\n\nAUDIO THAT'S MEANT TO MATCH STUNNING VISUALS\n\nAn increase in the number of power outlets, plugs and other electronic devices in your set-up can cause clashes among the signals they emit. This causes interferences, hiss and distortion. Here’s is where the iFi Audio iPurifier3 comes in. It removes the noise giving you only pure sound. It's all ready to purify all present and future PCM, DSD and DXD formats.\n\nACTIVE NOISE CANCELLATION2 & RECLOCK/REGENERATE/REBALANCE FOR NOISE-FREE CLEAR SOUND\n\nGroove to silence with the iPurifier3. Active Noise Cancellation2® (ANC2) technology creates an exactly identical but opposite signal to that of the noise signal and cancels it out. This reduces the noise by a 100 times (or 40dB) when compared to Common Noise Filters. The Reclock2/Regenerate2/Rebalance2 removes computer jitters as well as noise contamination to restore the USB audio+power streams and give you a balanced signal.\n\nHIGH-QUALITY TECHNOLOGY & AUDIO COMPONENTS\n\nThe iPurifier3 uses only the best of technology and components to give you a great USB audio playback experience. Premium components like OS-CON capacitors, tantalum capacitors, high-precision MELF resistors and a new copper-alloy shielding make this a high-quality product.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nUSB\nUSB3.0 + 2.0 compatible input port, USB2.0 High Speed output port\n\nCONNECTORS\niFi’FINAL’USB solid-aluminium connectors (Impedance: 90 Ohms)\n\nDIMENSIONS\n69(l) x 19(w) x 20(h)mm\n\nWEIGHT\n33g (0.1 lbs)\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. iFi Audio - iPurifier3\n\nDOWNLOADS\nUser Manual\nWarranty & Media Reviews\n\n1 Year Warranty\nDon't sweat it, this iFi Audio iPurifier3 comes with a 1 year warranty from iFi Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about iFi Audio's warranty in India.\n\n\"iPurifier3 you will find OS-CON capacitors that feature a low Equivalent Series Resistance (ESR), excellent noise reduction capability, ideal frequency characteristics and a long lifespan.\"\nRead More\n\n\"For a fair price, the iFi iPurifer 3 gets you a lower noise floor, more space, less ringing and more clarity in your music.Cleans up most USB noise from poor sources., Small and compact, bus powered\"\nRead More",
