  "material": null,
  "title": "iFi Audio - DC iPurifier 2",
  "id": "1564731703359",
  "description": "DESCRIPTION\n\nSILENCE IS GOLDEN, NOISE IS NOT\n\nAn increase in the number of power outlets, plugs and other electronic devices in your set-up can cause clashes among the signals they emit. This causes interferences, hiss and distortion. The iFi Audio DC iPurifier2’s Active Noise Cancellation2® (ANC2) technology creates an exactly identical but opposite signal to that of the noise signal and cancels it out.\n\nHIGH-QUALITY COMPONENTS & THE BEST TECHNOLOGY FOR A GREAT AUDIO EXPERIENCE\n\nThe DC iPurifier2 uses only the best of technology and components to give you a great experience. Along with Active Noise Cancellation2, the Panasonic SP-Cap Polymer Aluminium Capacitors greatly reduce the noise while keeping your device at a stable temperature. Premium components like high-precision MELF resistors and custom operational amps with copper-alloy shielding make this a high-quality product.\n\nCLEANS THE NOISE OF ANY DEVICE\n\nEnjoy a noise reduction for 5v -24v SMPS. Simply add your DC iPurifier2 in between the SMPS and the device whose noise you would like to clean and you are good to go. The noise will be reduced by a factor of 316x to 100,000x. It works with any DAC or desktop workstation.\n\nWORKS WITH ALL KINDS OF POWER SOURCES\n\nThe DC iPurifier2 is compatible with all kinds of power sources. It works with 5 x 1.35mm, 5 x 2.1mm and 5 x 2.5mm which makes it work seamlessly with any kind of DC barrel connector. It will bring out the definition, detail and warmth in your music.\n\nCLEANS NOISE ACROSS THE FREQUENCY RANGE\n\nA ground-up, ultra-wideband design cleans up noise from 1Hz to 5GHz with the best performance in between 20Hz and 20,000Hz. The DC iPurifier2 also protects your device by giving you a warning if the input polarity is reversed.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nVOLT COMPATIBILITY\nCompatible with 5-24 volt DC power supply units (up to 3.5A, 84W)\n\nCONSTRUCTION\niFi ‘FINAL’ aircraft-grade RFI shielded aluminium chassis\n\n3 DC BARREL VERSION\n5.5×2.1mm (adapters for 5.5×2.5mm and 3.5×1.35mm included)\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. iFi Audio - DC iPurifier 2\n\nDOWNLOADS\nTech Notes\nUser Manual\nWarranty & Media Reviews\n\n1 Year Warranty\nDon't sweat it, this iFi Audio DC iPurifier 2 comes with a 1 year warranty from iFi Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about iFi Audio's warranty in India.\n\n\"The iFi DC iPurifier2 is built with an ultra wide-band design that is effective from 1Hz to above 5GHz, with the strongest performance at 20Hz-20kHz.\"\nRead More\n\n\"The new generation DC iPurifier2 boasts a further optimised version of the much-acclaimed and award-winning ANC (Active Noise Cancellation) system adapted from military radar defence technology.\"\nRead More",
