  "id": "609596309567",
  "description": "DESCRIPTION\n\nTHE PERFECT CABLE FOR YOUR IEMS\n\nUpgrade your IEMs with the Campfire Audio Litz Cable. This cable consists of four silver-plated copper conductors. Each wire is individually enamelled. A flexible and durable jacket reduces microphonics and makes it a joy to be used. It features custom Beryllium Copper MMCX connectors that offer a robust mating mechanism as well as extends the life of the earphone.\n\nMULTIPLE CONNECTIVITY OPTIONS\n\nConnect your IEM to a variety of devices with the different terminations available: 3.5mm Stereo Plug: For use with the standard 3.5mm output of just about any portable audio device. 4.4mm 5-Pole Balanced: For use with high-end Sony digital audio players. Other devices are expected to include this output in the near future. 2.5mm 4-Pole Balanced: For use with hi-res DAPs from brands like Astell&Kern, Lottoo, etc. 3.5mm with Mic: For use with any Android device. Comes with an inline 3-button remote & mic.\n\nIn the Box\n\nBOX CONTENTS\nCampfire Audio - Litz Cable",
