  "description": "Designed & Made in USA\n\nFlat Sound Signature\n\nIdeal for Audiophiles\n\nFor Studio & Professionals\n\nIdeal for Indoor Use\n\n3 Years Warranty On Drivers\n\nOpen-Back Design\n\nPlanar Magnetic Drivers\n\nReplaceable Mini XLR Cables\n\nDESCRIPTION\n\nTHE ULTIMATE PLANAR MAGNETIC HEADPHONE\n\nGet the Audeze flagship sound without needing an amplifier. The LCD-4z features the planar magnetic drivers of the LCD-4, but with a 15Ω impedance. This means that it can be directly driven with just about any device, and it still sounds awesome with its robust and musically engaging sound signature. The lightweight cast-magnesium housing has been designed in Audeze's U.S. headquarters for long listening sessions.\n\nPOWERFUL DOUBLE FLUXOR™ MAGNETIC ARRAY\n\nAudeze spent decades of R&D to ensure that its Double Fluxor™ Magnetic Array is the most powerful open magnetic circuit ever created. It can generate a magnetic flux of 1.5 Tesla that delivers an unrivalled amount of power for true-to-life and accurate sound with immense depth.\n\nTHE THINNEST DIAPHRAMS IN THE WORLD FOR FLAWLESS SOUND\n\nAt just one-tenth the thickness of a red blood cell, the nano-scale diaphragms are some of the thinnest in the world. This offers an extremely fast and accurate transient response with almost no distortion. Furthermore, the diaphragms are laser-etched with the patented Uniforce™ voice coils for a flawless sound that captures every detail in your music.\n\nMIX & MASTER ANYWHERE & EVERYWHERE\n\nNot everyone can listen to their headphones in an acoustically treated room. With the Audeze Reveal plugin, you can add custom filter presets to all Audeze flagships. Now, mix and master in virtually any location, be it the studio, your home or even on top of an active volcano.\n\nSPECS\n\nSPECIFICATIONS\n\nTRANSDUCER TYPE\nPlanar transducer\n\nDIAPHRAGM\nNano-scale Uniforce™\n\nPHASE MANAGEMENT\nFAZOR\n\nMAGNET TYPE\nNeodymium N50\n\nFREQUENCY RESPONSE\n5Hz – 20kHz\n\nTRANSDUCER SIZE\n106 mm\n\nIMPEDANCE\n15 ohms\n\nSENSITIVITY\n98 dB/1mW\n\nMAXIMUM SPL\n130dB\n\nTHD\n<0.1% @ 100d\n\nMINIMUM POWER REQUIRED\n100mW\n\nCONTROLS & CONNECTIVITY\n\nWIRED CONNECTIVITY\n6.5mm\n\nCABLE\nsilver-plated OCC copper\n\nDESIGN & BUILD\n\nWEARING STYLE\nOver-ear\n\nWEIGHT\n3.17kg\n\nGRILL\nOpen Back\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. Audeze - LCD-4z Headphones\n\n2. 1/4in to dual 4-pin mini-XLR Premium LCD Headphone Cable\n\n3. Professional travel case\n\nBuying Guide\n\nBest Audiophile Headphones\nby Abhijeeth Shetty May 09, 2020\nThere are a lot of headphones available in the market posing themselves as audiophile headphones. Find out which ones of those actually serve the purpose?\nRead More\n\nFAQs\n\nWhat is the warranty period on Audeze - LCD 4z and how do I claim it?\n\nThe warranty period of the Audeze LCD-4z is of 3 years for the drivers and 1 year for the rest of the parts. In order to claim warranty, please visit our Audeze warranty page. We are very helpful guys, just saying.\n\nWhere are these headphones made?\n\nAudeze headphones are engineered and handcrafted in the USA to our exacting quality standards.\n\nHow does the Audeze LCD 4z sound?\n\nThe LCD 4z is a reference sounding headphones. No other headphone in the world features such a robust and musically engaging sound signature in such an efficient package.\n\nDoes the LCD 4z require amplification?\n\nNo, it does not require amplification. These headphones come with an impedance level of 15 ohms and hence it can be straight driven from the Aux port of your favorite listening device.\n\nDoes the LCD 4z come with a travel case?\n\nYes, it does come with a Professional travel case.\n\nCan these headphones be used for Studio purposes?\n\nYes, they are reference sounding headphones that are suitable for long listening sessions.\n\nCan the LCD 4z be used in a 3.5mm headphone output?\n\nYes, you will simply need the 6.5mm to 3.5mm adapter..\n\nWarranty & Media Reviews\n\n3 Year Warranty\nDon't sweat it, this Audeze LCD-4z comes with a 3 year warranty on the driver and a 1 year warranty on the rest of the parts. Audeze's warranty covers all manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Audeze's warranty in India.\n\n\"They are incredibly linear in their response, outstanding treble, midrange and bass that never sticks out, it coalesce into a single entity that reshapes musical bits into an analog whole.\"\nRead More\n\n“The LCD-4z sound embodies the very best qualities available from the thin membranes of planar magnetic drivers, carving out every secret, each lonesome detail.”\nRead More",
