  "id": "1604053499967",
  "description": "Designed in Japan\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nBest Suited for Portable Use\n\nMetal Build\n\nDESCRIPTION\n\nTHE BEST AMP/DAC, HIGH-QUALITY SOUND\n\nThe STAX SRM-D50 is a desktop amplifier/DAC for STAX electrostatic headphones. It has an ESS ES9018 DAC chip. This coupled with a TI OPA1642 ultra-low distortion op amp gives you a bit-correct signal representation. The SRM-D50 supports high-resolution audio up to PCM 32/384KHz or DSD 5.6. The R core power transformer offers less leakage flux.\n\nDURABLE & COMPACT, CONNECT EASILY\n\nThe SRM-D50 has been designed to be super-durable. The non-magnetic aluminium chassis is 4mm thick so that it is more robust. At the same time, it is also quite compact to easily fit on a table. The chassis contains one 5-pin output for your STAX Earspeaker and a VU meter. It also consists of various kinds of digital inputs like optical, USB and coaxial so that you can use your favourite source along with the SRM-D50.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nFREQUENCY RESPONSE\n20Hz - 40kHz (+/-3dB)\n\nHIGH HARMONIC DISTORTION\n0.025% or less/1kHz-10kHz /When use with SR-L series\n\nMAX. OUTPUT VOLTAGE\n400V RMS (1130Vp-p)\n\nBIAS VOLTAGE\nDC 580V\n\nGAIN\n59 dB\n\nINPUT IMPEDANCE\n20kΩ (RCA)\n\nCONTROLS & CONNECTIVITY\n\nRATED INPUT LEVEL\n130mV r.m.s\n\nMAXIMUM INPUT LEVEL\n30V/ RCA, at minimum volume\n\nDIGITAL INPUT\nUSB (type B) ×1、TOSLINK Optical ×1、COAX RCA ×1\n\nANALOG INPUT\nRCA ×1\n\nMAINS VOLTAGE\nAC 110V / 60Hz\n\nPOWER CONSUMPTION\n35W\n\nOPERATING TEMPREATURE\n0 to 35 degrees (Celsius) (less than 90% humidity, non condensing)\n\nDESIGN & BUILD\n\nDIMENSIONS\n7.55(W) x 2.63(H) x 10.55(D) inches, 192(W)×67(H)×268(D) mm\n\nWEIGHT\n9.9 lbs / 4.5 kg\n\nBATTERY\nSize AA battery x2 (Alkaline battery, Rechargable , Magnesium Dry Cell)\n\nIN THE BOX\n\nBOX CONTENTS\n1. STAX SRM-D50 Electrostatic Amp/DAC\n\nWARRANTY AND MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this STAX SRM-D50 comes with a 1 year warranty from STAX that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about STAX's warranty in India.\n\n\"The Stax SRM-D50 is purpose-built and high performance. If you have the budget to spend on this kind of high-end audio, this is absolutely the way to be spending it.\"\nRead More",
