  "description": "Designed & Made in the UK\n\nIdeal for Audiophiles\n\nBest for Indoor Use\n\n3 Years of Warranty\n\nMetal Build\n\nBluetooth with aptX\n\nFPGA DAC Chip\n\nDESCRIPTION\n\nEXPERIENCE THE BEST SOUND QUALITY\n\nEnjoy the highest quality sound possible with the Chord Hugo TT2. It supports files ranging from DSD 64 to DSD 512 as well as a wide range of PCM frequencies including 44.1kHz, 176.4kHz and 768kHz. The powerful Xilinx Artix 7 FPGA has been custom coded to create an advanced 16FS WTA 1 filter with 98,304-taps. In comparison, most other DACs have a 256-tap filter. It also features a 10-element design which gives you unparalleled clarity.\n\nLESS DISTORTION, LOUDER SOUND\n\nA high-power discreet output stage and second-order noise-shaping integration have been fitted in between the DAC output and filter. This has an impact in reducing distortion. The three-stage user-selectable digital crossfeed function improves the perception of depth and turns your headphone into your very own personal speaker. You also get the four-stage user-selectable filter controls that were first introduced with the Hugo 2.\n\nCONNECTS WITH JUST ABOUT ANY DEVICE\n\nThe Hugo TT2 can be used as a DAC, amp or pre-amplifier. It comes with two 6.5mm headphone jacks, one 3.5mm jack, a Stereo XLR as well as RCA outputs. It also has two DX BNC (expansion outputs). It has a variety of inputs to let you connect to a source device of your choice including 1 USB, 2 co-axial BNC and 2 optical inputs. You can also connect to another device using Bluetooth. It works driverless on Android, iOS, OS X and Linux. You will need to install a driver for Windows devices.\n\nSTYLISH, DURABLE & MEANT TO LAST LONG\n\nA precision-machined aluminium chassis and steel ball-bearing buttons make this DAC/Amp stand the test of time. The glass viewing portal, glossy black acrylic signal window, and dot matrix display are pretty as well as functional. Inspite of being made for home use, the Hugo TT2 features a Li-Po battery power supply as well as six supercapacitors. These are capable of delivering huge, linear dynamic currents and a peak output of 5A, 9.3V RMS.\n\nSPECS\n\nAUDIO SPECIFICATIONS\n\nCONNECTIVITY (INPUT)\n1x USB Type-B, 2x Coax BNC, 2x Optical & Bluetooth\n\nCONNECTIVITY (OUTPUT)\nStereo XLR, Stereo RCA, 2x 6.5mm Headphone Jack 1x 3.5mm Headphone Jack\n\nCONNECTIVITY (DIGITAL OUTPUT)\n2x DX BNC (Expansion Outputs)\n\nPCM SUPPORT\n44.1kHz, 48kHz, 88.2kHz, 96kHz, 176.4kHz, 192kHz, 358.8kHz, 384kHz, 705.6 And 768kHz\n\nDSD SUPPORT\nDoP DSD 64 To DSD 512 – Native Via Windows\n\nVOLUME CONTROL\nDigital\n\nLINE-LEVEL MODE\nActivated Within The Menu\n\nDRIVER SUPPORT\nDriverless With Mac OS X And Linux, Driver Required For Windows OS\n\nDYNAMIC RANGE\n127dB\n\nNOISE\n4 UV ‘A’ Weighted (High Gain), 1.7 UV ‘A’ Weighted (Low Gain) With No Measurable Noise Floor Modulation\n\nDISTORTION\n0.00008% @ 2.5 V 300Ω; 0.00016% @ 6 W 8Ω\n\nOUTPUT POWER (UNBALANCED)\n(@1% THD) 288 MW RMS 300Ω; 7.3 W RMS 8Ω\n\nOUTPUT POWER (BALANCED)\n(@1% THD) 1.15 W RMS 300Ω; 18W RMS 8Ω\n\nOUTPUT IMPEDANCE\n0.042Ω\n\nSTEREO SEPARATION\n9 V RMS 300Ω -138dB\n\nDIMENSIONS\n5.2cm (H) 23.5cm (W) 23.8cm (D)\n\nWEIGHT\n2.53kg\n\nIN THE BOX\n\nBOX CONTENTS\n1. The Chord Hugo TT2\n\n2. Compact Remote Control\n\n3. 1.5m 12v 0.5a Switching Power Supply\n\n4. 1.5m Type A To Type B USB Cable\n\n5. Hugo TT Overview Manual\n\nUser Guide\n\nLearn how to make the most out of your Chord Hugo TT2 with information on how to protect and clean your device from time to time. Get information on battery life indicators and configuring these with other devices.\n\nRead More\n\nWarranty & Media Reviews\n\n3 Year Warranty\nDon't sweat it, this Chord Hugo TT2 comes with a 3 year warranty from Chord that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Chord's warranty in India.\n\nAudio Excellence\nHIFICRITIC 2016-2017\n\nBest of 2019 Winner\nThe Ear Dec, 2019\n\nThe Absolute Sound\nGolden Ear Award Aug, 2019\n\nBest Desktop Source\nHeadfonia Dec, 2020\n\nBEST DESKTOP AMP/DAC 2021\nHEADFONICS Dec, 2021\n\n\"The Hugo TT2 is a brilliant DAC. Chord has produced yet another class leader. In performance and feature terms it’s possible to make a strong case for the TT2 to be considered the best value DAC.\"\nRead More\n\n\"Hugo TT 2 establishes a whole new level of excellency for Chord Electronics’ Its possibly one of the most difficult write-ups I have had to do, not because it was bad, quite the opposite, it is rather brilliant.\"\nRead More",
