  "description": "Designed & Made in the USA\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nBest for Home or Desktop Use\n\nMetal Build\n\nDESCRIPTION\n\nENGINEERED PARTICULARLY FOR THE STAX EARSPEAKER\n\nConnect your favourite STAX Earspeaker having Pro Bias 5-pin output easily to the Woo Audio WES (2nd gen). You can even connect the WES (2nd gen) to your favourite audio sources with an RCA input and 2 XLR inputs.\n\nFEATURING 12 VACUUM TUBES TO OFFER OPTIMUM LEVELS OF POWER SUPPLY\n\nEquipped with 12 vacuum tubes, the Woo Audio WES (2nd gen) Electrostatic Headphone Amplifier. These tubes consist of 4 EL34 tubes for power and  4 6SL7 tubes for the driver along with  2 5AR4 rectifier tubes and 2 12AU7 for phase inverters.\n\nOPTIMUM DUAL-POWER SWITCH FOR A FATIGUE-FREE REFERENCE SOUND\n\nWith an innovative dual power switch, this amp is designed to be sensitive on the tubes particularly when starting the unit from cold. Flip the first switch on and it provides low voltage to the heaters while the amp itself remains in standby mode. On turning both switches on, the Woo Audio WES (2nd gen) will work in full power giving you fatigue-free reference-quality sound.\n\nCONSISTS SINGLE CRYSTAL COPPER WIRES FOR SONIC CLARITY AND DYNAMIC RANGE\n\nExperience excellent sound delivered through the purest form of copper wires. The Woo Audio WES (2nd gen) comes with a matching quad of output loading chokes that use Single Crystal Copper wires to deliver sound with great clarity, dynamics, space and control.\n\nDESIGNED FOR EFFORTLESS UTILITY, STYLE AND DURABILITY\n\nPowered by a two-chassis system, the overall design of the Woo Audio WES (2nd gen) is made out of anodised aluminium. It includes a power supply and a fully balanced amplifier. With the support of a balanced smooth potentiometer and dual power switch, using this amp becomes a breeze.\n\nSPECS\n\nSPECIFICATIONS\n\nHEADPHONE OUTPUT VOLTAGE SWING\n1300 volts p-p\n\nSTAX PRO BIAS\n580V\n\nSENNHEISER HE90 BIA\n500V\n\nSIGNAL/NOISE\n100 dB\n\nTHD\n\nAC VOLTAGE\nAC 110/220 - 240V, 50/60 Hz, selectable\n\nPOWER CONSUMPTION\n118 watts\n\nDIMENSIONS\nPSU:4.5”(H), 16.5”(W), 12”(D) AMP:7.5”(H), 16.5”(W), 12”(D) (with tube guard)\n\nWEIGHT (AMP + PSU)\n40 pounds or 18.2 kg\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. WES (2nd gen) electrostatic headphone amplifier x 1\n\n2. WES (2nd gen) power supply unit x 1\n\n3. EL34 vacuum tubes x 4\n\n4. 6SL7 vacuum tubes x 4\n\n5. 5AR4 vacuum tubes x 2\n\n6. 12AU7 vacuum tubes x 2\n\n7. Umbilical DC cord x 1\n\n*AC power cord and audio cables are not included\n\n8. Quick start guide\n\nWarranty & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this Woo Audio WES (2nd gen) comes with a 1 year warranty from Woo Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Woo Audio's warranty in India.\n\n\"The Woo WES is an all-triode tube drive, fully balanced design. The amp also features handmade inductors, and even the machined cone feet are designed specifically for the WES.\"\nRead More\n\n\"Electrostatic drivers are the key elements here, promising far lower distortion than standard dynamic drivers. The up-side is a system that can reveal unheard detail in even familiar tracks.\"\nRead More\n\n\"I can state that my experience with the STAX SR 009 and the WOO AUDIO WES combination was a “mind blowing” revelatory immersive experience. I am very happy with the new soundexperience.\"\nRead More\n\n\"The WES is one of those break through products that leaves you wondering about the future of high-end audio. For now, I have reached a new level of satisfaction.\"\nRead More",
