  "title": "Woo Audio - GES",
  "id": "1553156964415",
  "description": "Designed & Made in the USA\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nBest for Home or Desktop Use\n\nMetal Build\n\nDESCRIPTION\n\nENGINEERED PARTICULARLY FOR THE STAX EAR SPEAKER\n\nConnect your favourite STAX Earspeaker having Pro Bias 5-pin output easily to the Woo Audio GES. You can even connect the GES to your favourite audio sources with 2 RCA inputs.\n\nLETS YOU EXPLORE YOUR LOVE FOR SOUND EXPERIMENTATION\n\nUtilizing 4 6S4 power tubes and 4 12AX7 tubes for the driver, the Woo Audio GES allows you to experiment. You can even exchange driver tubes with Polytetrafluoroethylene (PTFE) tube sockets. The GES supports ECC83, ECC803S, 12BZ7, 12AD7, 5751, 7025, 7058, B339 and B759 tubes.\n\nDESIGNED FOR EFFORTLESS UTILITY, STYLE AND DURABILITY\n\nThe anodised aluminium chassis has been built to last for generations. The ALPS potentiometer and the power switch installed in the Woo Audio GES work efficiently to give you a practical and easy-to-use amplifier.\n\nSPECS\n\nSPECIFICATIONS\n\nSUPPORTED INPUTS\n2x RCA input\n\nINPUT IMPEDANCE\n100 Kilo-Ohms\n\nFREQUENCY RESPONSE\n10 Hz - 80 KHz, -3dB\n\nSIGNAL/NOISE\n100 dB\n\nBIAS VOLTAGE\n580VDC\n\nTHD\n\nMAXIMUM OUTPUT\n800Vrms\n\nVOLTAGE\nAC 110/220V, 50/60 Hz\n\nCOMPATIBILITY\nall STAX, HiFiMan Shangri-la Jr., Dan Clark Audio VOCE electrostatic headphones\n\nDIMENSIONS\n5½\"(H), 13\"(W), 10½\"(D)\n\nWEIGHT\n22.5 lbs.\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. GES electrostatic headphone amplifier x 1\n\n2. 12AX7 vacuum tubes x 4\n\n3. 6S4 vacuum tubes x 4\n\n4. Quick start guide\n\n*AC power cord and audio cables are not included\n\nWarranty & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this Woo Audio GES comes with a 1 year warranty from Woo Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Woo Audio's warranty in India.\n\n\"The look is simple, functional, made with great care. It's not fancy, no cheap design effects, it's more the kind of object, which you still like ten years later.\"\nRead More",
