  "title": "Woo Audio - WA6 (2nd gen)",
  "id": "1554588827711",
  "description": "Designed & Made in the USA\n\n1 Year of Warranty\n\nIdeal for Audiophiles\n\nBest for Home or Desktop Use\n\nBalanced Output\n\nMetal Build\n\nDESCRIPTION\n\nA RELIABLE AMP THAT PAIRS PERFECTLY WITH ALMOST ALL KINDS OF HEADPHONES\n\nThe Woo Audio WA6 (2nd gen) Headphone Amplifier can drive almost all kinds of headphones and In-Ear Monitors including IEMs with impedance as low as 8Ω and power-hungry headphones with an impedance of at least 600Ω. So if you want to enjoy the best performance of your favourite headphone, the Woo Audio WA6 (2nd gen) is your way to go.\n\nFEATURING A PURE TUBE DESIGN FOR OPTIMUM POWER SUPPLY\n\nThis amp has a pure tube design that includes 2 13DE7 tubes and 1 5U4G rectifier tube to support the driver and to gain more power. Using a Class-A, transformer-coupled, single-ended triode (SET), the amplifier can drive even the most power demanding headphones with absolute ease.\n\nEQUIPPED WITH ANODISED ALUMINIUM CHASSIS FOR ENDURANCE AND LONGEVITY\n\nThe anodised aluminium chassis has been built to last for generations. The ALPS potentiometer and the power switch installed in the Woo Audio WA6 (2nd gen) work efficiently to give you a practical and easy-to-use amplifier.\n\nSPECS\n\nSPECIFICATIONS\n\nAUDIO INPUTS\n1x RCA input\n\nAUDIO OUTPUT\n1/4\" (6.3mm)\n\nINPUT IMPEDANCE\n100 kilo-ohms\n\nOUTPUT IMPEDANCE\n30 to 60 ohms\n\nOUTPUT POWER\n580 mW at 32 ohms to 400mW at 600 ohms with 6DR7 tubes\n\nSIGNAL/NOISE\n93 dB\n\nTHD\n\nFREQUENCY RESPONSE\n20 Hz to 30 kHz, –3 dB\n\nCOMPATIBLE HEADPHONE IMPEDANCE\n8 to 600 ohms\n\nWEIGHT\n13 lbs\n\nDIMENSIONS\n6\"(H), 5½\"(W), 13\"(D)\n\nIN THE BOX\n\nBOX CONTENTS\n\n1. WA6 (2nd gen) headphone amplifier x 1\n\n2. 13DE7 vacuum tube x 2\n\n3. 5U4G vacuum tube x 1\n\n*AC power cord and audio cables are not included\n\nWarranty & MEDIA REVIEWS\n\n1 Year Warranty\nDon't sweat it, this Woo Audio WA6 (2nd gen) comes with a 1 year warranty from Woo Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about Woo Audio's warranty in India.\n\n\"Woo Audio’s WA6 is a Class A headphone amp whose glowing tubes are voiced to warm up any headphones. Warm, tubey sound, Headphone impedance switch, New York born.\"\nRead More\n\n\"Woo Audio - WA6 sound is very smooth without ironing out any details. If I have to give a three words summary of the WA6, it’ll be: smooth, thick, and impactful.\"\nRead More\n\n\"The build quality is absolutely superb, chassis looks absolutely gorgeous, and features some of the highest quality aluminum that I’ve only seen in higher end amplifiers.\"\nRead More",
