  "title": "iFi Audio - Mercury 3.0",
  "id": "733518757951",
  "description": "DESCRIPTION\n\nHIGH-QUALITY MATERIALS FOR OPTIMAL PERFORMANCE\n\nThe Mercury 3.0 has been crafted by expert engineers who have used only high-quality materials. It uses heavy OFHC continuous copper silver matrix conductors that have end-to-end shielding for the cable. The Final USB connectors have been machined from aircraft-grade aluminium and used gold-plated connections for extra durability.\n\nNOT YOUR AVERAGE USB CABLE\n\nUnlike common USB cables that come with barely any shielding, the Mercury 3.0 has a quadruple shielding that entirely separates and protects the USB signal from any power interference. This reduces EMI and RFI cable noise and gives you the cleanest audio you can possibly get.\n\nSHHH... ONLY PURE SOUND\n\nThe Mercury 3.0 has 3 custom-made metal oxide ceramic RF noise silencers. Since each filter has a different effective range, the RF noise is silenced over a wider range. While 2 silencers are fixed at opposite ends of the range, the middle one is adjustable and can be moved along the entire length of the cable. This detunes the antennae formed by the cable and further reduces noise.\n\nFASTER, SMOOTHER, HIGHER STANDARDS\n\nEnjoy a faster and smoother audio experience with the Mercury 3.0. This USB cable is crafted with high-quality cables and connectors. This ensures a higher standard transmission platform and a less jittery audio & power transfer. (PS: The Mercury 3.0 can support a bandwidth speed of 5.0Gbps which makes it future-proof).\n\nSpecs\n\nAUDIO SPECIFICATIONS\n\nCONSTRUCTION\nMinimu inductance parallel construction\n\nCONDUCTOR\n24 and 28AWG\n\nCONDUCTOR MATERIAL\nHeavy OFHC continuous cast copper silver matrix\n\nINSULATION\nHD Polyethylene\n\nSHIELDING\nQuadruple-shields\n\nIMPEDANCE\n90 Ohms (1% tolerance)\n\nAC SPARK INSULATION\n1500V\n\nCONNECTORS\niFi ‘FINAL’ USB connectors\n\nINSULATION RESSISTANCE\n100Mohm\n\nTENSILE STRENGTH\n1500PSI\n\nLENGTH/WEIGHT\n0.5m/98g (0.22 lbs) 1.0m/115g (0.25 lbs)\n\nIN THE BOX\n\nBOX CONTENTS\n1. iFi Audio - Mercury 3.0\n\n2. OTG USB Type-C Adapter\n\n3. Warranty Card\n\n4. User Manual\n\nDOWNLOADS\nUser Manual\nWarranty & Media Reviews\n\n1 Year Warranty\nDon't sweat it, this iFi Audio Mercury 3.0 comes with a 1 year warranty from iFi Audio that covers manufacturing defects. All products featured on Headphone Zone are backed by an original manufacturer's warranty. Read more about iFi Audio's warranty in India.\n\nGREATEST BEATS\nAudio Stream Mar, 2018\n\n\"Build quality-wise this cable is exceptionally good. iFi claims that the cable utilizes Heavy OFHC continuous copper silver matrix conductors for the best possible signal transfer.\"\nRead More\n\n\"iFi Mercury3.0 isUSB 3.0 cable. Which provide a smoother path for signals to flow through, meaning less-jittery audio and power transfer, for much smoother audio.\"\nRead More\n\n\"The Mercury3.0 single run cable has quadruple shielding to fully separate and protect the delicate USB data signal from the USB power and reduce noise contamination.\"\nRead More",
